	('128ec8be-6843-4d9e-9b99-67b983fd3b7a', '2024-10-23 11:21:13.382976+00', 'f874562c-fcb5-4c62-bd29-0370dbdf6260', 'https://aglintai-seed-data.vercel.app/jobs/backend-engineer/michael_johnson_backend_engineer_resume.pdf', 'Michael Johnson Email: michael.johnson@gmail.com Phone: +1-202-555-2004 Location: San Francisco, CA Professional Overview Full Stack Developer with a strong background in backend technologies, including Node. js and databases. Skills - Node.js - Express - MongoDB - Redis - Docker Education B.Sc. in Computer Science University of California, Berkeley Graduated: 2016 Experience Company: Facebook, San Francisco, CA Role: Full Stack Developer Duration: 4 years ', '{"basics": {"email": "michael.johnson@gmail.com", "phone": "+1-202-555-2004", "social": [], "lastName": "Johnson", "linkedIn": null, "location": {"city": "San Francisco", "state": "CA", "country": "USA"}, "firstName": "Michael", "currentCompany": "Facebook", "currentJobTitle": "Full Stack Developer", "totalExperienceInMonths": 48}, "skills": ["Node.js", "Express", "MongoDB", "Redis", "Docker"], "schools": [{"end": {"year": null, "month": null}, "gpa": null, "field": "Computer Science", "start": {"year": 2016, "month": null}, "degree": "B.Sc. in Computer Science", "institution": "University of California, Berkeley"}], "overview": "Michael Johnson is a Full Stack Developer at Facebook with expertise in Node.js, Express, and MongoDB.", "projects": [], "languages": [], "positions": [{"end": {"year": 2020, "month": null}, "org": "Facebook", "level": "Mid-level", "start": {"year": 2016, "month": null}, "title": "Full Stack Developer", "location": "San Francisco, CA", "description": "Full Stack Developer with a strong background in backend technologies, including Node.js and databases."}], "certificates": []}', NULL, NULL, NULL, NULL, 'resume'),
	('84a4e7bc-f19d-4e13-8965-a78696623632', '2024-10-23 11:21:13.415225+00', 'dac0454f-cb8a-454a-8c7a-d916143de09c', 'https://ecfwsyxpcuzxlxrkhxjz.supabase.co/storage/v1/object/public/resume-job-post/public/0eeae879-ef87-4863-8097-e400fa0e6518.pdf', 'CLAIRE GROSJEAN Los Gatos, CA | 408.508.CGrosjean1@Outlook.com | LinkedIn SENIOR FINANCE & OPERATIONS EXECUTIVE Financial Management & Transformation, High-Growth Tech Environments Strategic Vision & Operational Planning ▪ Intelligent Automation & RPA ▪ Corporate Strategy & Development Innovative Global Finance Executive with expertise in FP&A, financial reporting, and asset-liability management. Excels in strategic project management, risk mitigation, and process optimization across global settings. Skilled at leading diverse teams, with commitment to nurturing talent using goal-oriented approach, empowering team members to realize and exceed their potential. Fosters cross- functional collaboration and adept in Agile and Waterfall methodologies. Dual US & French citizen; fluent in French. Driving Innovation and Efficiency in High-Tech & Financial Services Strategic Financial Leadership → Currently lead the strategic planning company-wide. Oversaw Accounting, FP&A and Financial Reporting for small and publicly traded companies. Led major modernization for SVB, supporting growth from $5B to over $200B in assets. Generated $30M+ in annual value realization, achieving substantial cost savings and revenue enhancements. Process Automation & Efficiency → Streamlined financial close cycle from 11 to 5 days, enhancing agility in financial operations; spearheaded deployment of over 50 RPA bots for heightened productivity, advancing automation initiatives, led many systems implementations. Cross-Functional Collaboration → Recognized for excellent people management, developing and motivating, multi-disciplinary teams while fostering inclusive culture. Steered pivotal projects such as implementation of cross-departmental process optimization and Automation initiatives leveraging JIRA. Areas of Expertise: Strategic Planning | Budget & Forecast | Financial Planning & Analysis | Financial Reporting & auditing | Profitability | Regulatory Compliance & Risk Management | Digital Transformation Initiatives | Intelligent Automation Implementations| Cross-Functional Leadership | Stakeholder Engagement | Corporate Development Execution | Continuous Process Improvements PROFESSIONAL EXPERIENCE Technology Credit Union | San Jose, CA Member-focused Bay Area financial institution known for its commitment to technology-driven banking solutions. SENIOR DIRECTOR, BUSINESS PROCESS MANAGEMENT Multi-faceted role under the COO that includes leading the strategic planning enterprise-wide, managing Senior Business Analysts working on complex projects and programs, and leading initiatives to streamline and automate processes leveraging intelligent automation tools. Sep 2023 – Present ● Lead the strategic planning process leveraging OKRs and KPIs to focus and align on the top strategic initiatives. ● Manage the work of 4 Senior Business & Process Analysts currently supporting the development of a new digital banking platform as well as geographic expansion. ● Lead enterprise-wide business process management and continuous improvement initiatives including defining a process inventory using APQC methodology and best-practice process management. ● Actively exploring and evaluating additional intelligent automation solutions such as Intelligent Document Processing and Agent AI tools. ● Spearhead a strategy for knowledge management at TechCU to enable the right information to be available to the right person at the right time. ● My team has delivered process improvement initiatives leveraging Appian and DocuSign adding up to annual cost savings of over $1M to-date and looking to realize another $1.5M in cost savings over the next 12 months. Voice of the Customer in the Automation Landscape (VOCAL) Council 2022-Present Peer powered global community of decision makers and users of Automation technologies including RPA, Intelligent Automation, Machine Learning, Natural Language Processing, Process Mining, Intelligent Document Processing, Artificial Intelligence and more. Active participant and speaker at various events such as Intelligent Automation week and IA Select presented by SSON. 408.508.CGrosjean1@Outlook.com | linkedin.com/in/claire-grosjean1 Silicon Valley Bank | Santa Clara, CA – Became division of First Citizens Bank as of March 27, 2023 Financial partner for innovative tech and startup sector. Grew from 1,000 to 8,500 employees over tenure MANAGING DIRECTOR – GLOBAL OPERATIONS & SERVICING Expanded role under Head of Global Operations, with added responsibilities for process improvement and change management teams, bringing team to up to 20 members. Drove significant cross-functional initiatives, collaborating closely with credit and other departments to meet critical deadlines and achieve shared objectives. 2005 – June 2023 (2021 – 2023) ● Spearheaded initiatives that resulted in $10M in perpetual savings from process optimization, contributing to profitable growth where every $3 of additional revenue added only $1 in expenses. ● Led 3 diverse teams with 6 direct reports, workforce management, program managers, change practitioners, and product managers. Teams focused on intelligent process automation, process mining, and enterprise content management tools leveraging Automation Anywhere, Appian, OpenText suite, and Celonis. ● Achieved reduction in financial close cycle from 11 days to 5 days, enhancing operational efficiency and freeing resources for more value-add transactions. ● Recognized for exceeding personal KPIs of $5M annual value realization and reducing operations and credit close cycle time from 4 days to 1 day; reduced efficiency ratio (expenses/revenues) by 2%. ● Delivered over $30M in combined annual value realization (2021, 2022, and 1H2023) through cost avoidance, cost savings, and additional revenues, significantly impacting bottom line. ● Assumed additional oversight of contact center workforce management, enhancing scalability and efficiency of client service. ● Celebrated team successes in implementing initiatives on time, within scope and budget, and fostered positive work environment that improved employee retention by 5 points. SENIOR DIRECTOR, PROCESS ENABLEMENT – ENTERPRISE PROCESS MANAGEMENT (March 2020 – March 2021) Transitioned to operations in this role, reporting to Head of Enterprise Process Management. Collaborated extensively with risk management team, supported risk control assessments and control remediations. ● Led implementation of additional RPA bots and integration of Intelligent Automation tools like OpenText (Documentum and Magellan AI Text Mining). Fostered more robust partnership with technology team, enhancing cross collaboration. DIRECTOR, PROCESS AUTOMATION – FINANCE TRANSFORMATION OFFICE (March 2018 – March 2020) Provided company-wide leadership in business process improvement and low-code automation. Actively involved in cross- functional initiatives like CECL (current expected credit loss), financial close optimization, and credit risk ratings adjustment. ● Collaborated with leaders across service operations, product management, solution architecture, data, and technology to drive ● comprehensive operations-focused roadmap supporting large-scale initiatives and meeting evolving company needs. Implemented 25+ digital workers (RPA bots) in finance, risk, and credit admin, saving over 50,000 hours annually in manual labor. DIRECTOR, PROGRAM MANAGEMENT – FINANCE (April 2013 – March 2018) Reported to Chief Accounting Officer during critical growth phase as bank approached $60B asset mark, requiring alignment with heightened regulatory demands and system enhancements. Managed outsourced accounting functions to Accenture in Chennai, India, overseeing evolution of relationship and ensuring efficiency and effectiveness of outsourced operations. ● Oversaw finance automation initiatives under directive of CFO, focusing on implementation of robotics process automation (RPA), setting bank on a path of technological elevation and operational efficiency. ● Managed corporate finance planning roadmap, leading teams of process engineers and technical writers. Responsible for selection, implementation, and ongoing support of 26 finance systems. ● Led expansion of offshore team, growing from 8 members in 2009 to over 80 by 2018, along with management of 2 managers in California and Arizona, demonstrating effective leadership in diverse and evolving team environment. CORPORATE CONTROLLER – FINANCE (August 2005 – April 2013) Directed team of 25 finance professionals, ensuring accurate and timely preparation of quarterly and annual financial statements in accordance with US GAAP, covering SVB FG (Holding Co.) and over 40 subsidiaries during period of transformation and modernization of financial systems to support bank''s rapid growth, starting from $5B in assets, and workforce expansion to 2,500 employees. ● Developed and implemented first set of SOX (Section 404) controls for SVB, enhancing financial integrity across operations. ● Worked cross-functionally during transition to scalable financial solutions, including new general ledger platform and Coupa procure-to-pay system for enhanced process efficiency, ensuring all entries into general ledger were complete and accurate. ● Honored with “Biggerstaff” award for exemplifying SVB''s guiding principles through exceptional leadership, client focus, and outstanding performance. 408.508.CGrosjean1@Outlook.com | linkedin.com/in/claire-grosjean1 ADDITIONAL EXPERIENCE Vice President, Finance | Assistant VP | Treasury Manager, Meriwest Credit Union, San Jose, CA (1998-2005) Led Accounting, Treasury, and FP&A for $1B credit union, maintaining financial integrity and driving asset and member growth. Key accomplishments include overseeing annual budget of $50M, managing investment portfolios during varying interest rate cycles, and implementing strategic financial practices that enhanced profitability and operational efficiency. CFO-Partner (part-time), IDB Consulting, Mountain View, CA (1998-2008) Developed financial statements and consolidation with French parent company and launched specialized offering, ''MyCFO'' services. Accounting Manager | Senior Financial Analyst, Pacific IBM FCU, San Jose, CA (1993-1998) Managed liquidity, ALM, and investment portfolio. BOARD LEADERSHIP Governing Board Member, Pacific Collegiate School, Santa Cruz, CA 2019 – 2023 President (2022 – 2023) | Vice President (2021 – 2022) | Treasurer (2019 – 2021) Led board initiative for one of the top public charter schools in the nation, co-founded by Netflix CEO, Reed Hastings Secured key PPP funds during pandemic and negotiated contracts during financial challenges EDUCATION & PROFESSIONAL DEVELOPMENT Master of Business Administration (MBA), Finance CALIFORNIA STATE UNIVERSITY EAST BAY, HAYWARD, CA Bachelor of Science, Business – Accounting (DESCF) LYCÉE OF SEVRES, PARIS, FRANCE Lean Six Sigma Green Belt, Aveta Business Institute Kanban System Design Certification, Kanban University UI Path Business Analyst Foundation Training Certificate, UI Path Academy Certified Public Accountant (Inactive), State of California 408.508.CGrosjean1@Outlook.com | linkedin.com/in/claire-grosjean1', '{"basics": {"email": "408.508.CGrosjean1@Outlook.com", "phone": null, "social": [], "lastName": "GROSJEAN", "linkedIn": "linkedin.com/in/claire-grosjean1", "location": {"city": "Los Gatos", "state": "CA", "country": ""}, "firstName": "CLAIRE", "currentCompany": "Technology Credit Union", "currentJobTitle": "SENIOR FINANCE & OPERATIONS EXECUTIVE", "totalExperienceInMonths": null}, "skills": ["Financial Management", "Strategic Planning", "Operational Planning", "Intelligent Automation", "RPA", "Corporate Strategy", "Financial Reporting"