ance, restructuring, revenue recognition, derivatives, investments, leases, earn- out)  Implemented new accounting standards, analyzed new accounting pronouncements  Reviewed Forms 10-Qs/10-K and coordinated key timelines and deliverables of filings  Presented 3 Technical accounting webcasts to 500+ audience Ernst & Young (EY) Assurance Manager, San Jose, CA Oct 2015 – Jul 2019  Clients: Hewlett Packard, Verifone, Centrify, GlobalFoundries, SunPower, Hanergy  Advised clients through complex transactions, initial public offering, acquisitions, SOX implementation  20+ audits, quarterly reviews clients ranging between 50M to 20B in revenue  Oversaw SEC filings, 10-K, 10-Q, S-1, SEC comment letters response, comfort letters  Hewlett Packard spinoff: managed 1 US team and 3 component teams totaling more than 20 individuals; designed opening balance sheet audit approach for 100+ newly created legal entities  Audited business combinations accounting, ASC 606 & ASC 718 issues, equity method investment, forecasts, 409 valuations, goodwill impairment analyses, liaised with specialists, Instructor for 10+ training courses (class size 25-40) covering new accounting topics and data analytics   EY M&A Transaction due diligence rotation: Sell-side due diligence of divestiture of SunPower  Prepared quality of earnings, analyzed data using Alteryx and Spotfire PricewaterhouseCoopers (PwC), Senior associate, San Jose, CA Clients: Yume (S1, IPO), GoPro (1st year after IPO), Gigamon (S1, 1st year after IPO), ServiceNow Ernst & Young (EY), Associate Oct 2012 – Oct 2015 Oct 2010 – July 2012 EDUCATION & ACHIEVEMENTS University of North Dakota (UND), Bachelor Accounting and Finance Cum Laude ♦ Dec 2009  Xperi Inc.: recognized for successful execution of Separation, attended NYSE bell ringing ♦ 2022  EY: 8 Bravo awards from 7 different individuals for successful audit completion ♦ 2015-2019  PwC: Transformation award, 3 Contribution awards and 6 Difference Makers awards ♦ 201