	('a0dc724d-41ef-4d2d-be80-8e70d02bba89', '2024-10-23 11:21:13.452945+00', '56601590-c226-489d-881a-3508bdfa9c8a', 'https://ecfwsyxpcuzxlxrkhxjz.supabase.co/storage/v1/object/public/resume-job-post/public/464e707f-e308-4bcb-b349-bdd3a930a007.docx', 'Monto Khanna, CPA Santa Clara, CA 95051 montocpa@gmail.com 4087093 Industry Experience: Full Time Consultant: May 2020 - present Interim Controller/Director of Accounting/Accounting Manager for Public company Bio-tech – audit with big 4, financial reporting, 10K/Q High growth SAAS and hardware companies – day to day accounting, cap-table management, KPI, BOD slides, due diligence on various rounds of funding Completed SPAC for Cannabis company. Sustainable energy – financial accounting, first year audit with E&Y, preparing for potential IPO, AARPE audits, SOX implementation Implemented Netsuite for various clients Implemented ASC 606 and 842 Other clients includes Construction, Property Management Companies, Hotels/Motels, Restaurants, etc. Simpler Postage, Inc Director-Accounting Oct 2017-April 2020 Directed, managed and responsible for accounting, FP&A, payroll and tax compliance. Carved out the Fulfilment Business from the total business and sold to another Fulfilment Company. Managed the due diligence and integration of customers, revenues, COGS, and assignment of operating and capital leases to the new buyer. Consolidated 8+ companies. Updated FP&A model to reflect new business initiatives. Implemented Netsuite. Implemented policies which reduced accounting close from 20+ days to 3 days. Revamped the entire department after auditors left the audit in between. Managed audits of financial statements from inception, including 6 years at once. Managed transition of Payroll system and 401K providers. Managed Series A+ due diligence from various investors. Prepared Company’s first short-term and long-term budgets. Implemented ASC 606 and 842. Prepared BOD presentation. Managed Cap table and stock-based compensation. Managed 409 A valuation. Managed compliance with Insurance and sales tax. Managed team of professional accountants and financial planning analysts. Anova Applied Electronics, Inc Controller April 2016 to Sept 2017 Acquired by Electrolux for $250M in April 2017, $10B USD market cap. Managed end to end Integration of Anova’s accounting and finance into Electrolux. Transitioned from US GAAP to Swedish IFRS. Calculated Purchase Price adjustment as per US GAAP. Prepared dashboards to understand unit economics on a daily basis, country by country, sku by sku, and discount offered vs paid marketing spend. Managed sales programs of a bootstrapped Company with more than 900 Doors (B2B). Led the accounting, finance and tax due diligence in absence of full time CFO. Managed the entire due diligence from Ernst & Young, Cooley, and Paul Hastings. First accounting hire in the company. Completed first year audit with PwC. Prepared monthly consolidated Financial Statements for 10+ US entities in US GAAP and IFRS. Managed the entire manufacturing operations with Chinese partner. Responsible for BOM, PPV, obsolescence, cycle count, month end counts, etc. Implemented various accounting and internal controls to streamline accounting and business operations. Managed net working capital requirements of a bootstrapped start up. Business partner to all departments and developed annual and three years FP&A plan. Managed day to day accounting including AP, AR, Payroll, Banking relationship, etc. Coin Inc, San Francisco, CA Controller May 2015 to April 2016 Acquired by Fitbit-led due diligence of accounting and finance. Managed accounting and tax integration. Worked with Fitbit for smooth transition. Prepared monthly, quarterly and yearly financial statements. Prepared monthly, quarterly and yearly FP&A. Prepared weekly dashboard for CFO and E-team summarizing financial and non-financial transactions. Worked with VP of Engineering to develop custom reports to reconcile with payment processor. Care