ucted both domestic and international month end close, quarter end close and annual audits. Participated and prepared S-1 registration statement. Implemented various policies and procedures which reduced the month end close from 15 to 4 days. Implemented ERP (Oracle) and SOX for possible IPO. Prepared consolidated financial statements for audit purposes for US reporting and financial statements per IFRS for international subsidiaries. Experience in managing accounting of an offshore location. Manage staff of 12. Public Accounting Experience: Burr Pilger & Mayer LLP, San Jose, CA Audit Supervisor Mar 2008 to Jan 2009 McConnell & Jones, Houston, TX Audit Supervisor April 2007 to Feb 2008 PwC, Canada/USA Senior Associate Aug 2004 to Mar 2007 Kumar & Associates, Canada Senior Accountant June 2001 to July 2004 Conducted audits and reviewed financial statements for public and private clients in software, biotech, real estate, VC, asset management, private equity, etc. Managed IPO of various Companies in TSX. Involved in preparation of S-1 for various clients. Involved in Air Canada external yearly audit. As a consulting supervisor at PwC, consolidated 17 companies into Nortel’s consolidated financial statements. Took the complete ownership and managed project in a timely manner. Experience in preparing financial statements under IFRS. Conducted SOX engagements on Citibank Canada. Education: Certified Public Accountant, USA MS Finance and Financial Law, University of London, UK Bachelor of Commerce (Hons.) University of Delhi, India References: Available on request', '{"basics": {"email": "montocpa@gmail.com", "phone": "4087093", "social": [], "lastName": "Khanna", "linkedIn": null, "location": {"city": "Santa Clara", "state": "CA", "country": "USA"}, "firstName": "Monto", "currentCompany": "Monto Khanna, CPA", "currentJobTitle": "Full Time Consultant", "totalExperienceInMonths": 264}, "skills": [], "schools": [{"end": {"year": null, "month": null}, "gpa": null, "field": "