 financial and operational risks implement a self-funded health insurance program, optimizing cost management and coverage flexibility Telmate (GTL) San Francisco, CA VP of Finance 2013 - 2014 Highlights: Strategized with CXOs and VPs to achieve a 36% business growth through strategic financial management and operations optimization Directed and managed the full spectrum of controllership disciplines, including financial reporting, budgeting, planning, international consolidations, financial analysis and treasury functions Established and maintained robust accounting policies and procedures to create a stable framework for growth Managed global accounting practice, payroll and compliance with Asia; led consideration of HR practices to address global workforce and cultural considerations Managed annual review process, presentation and documentation, including complex guidelines for revenue recognition and accounting conversions Structured corporate insurance and risk management matters, including a heavy focus on workforce management Directed the company through sector consolidation in the telecommunications industry, managing operational integration and organizational restructuring up to the successful exit through acquisition SnapLogic San Mateo, CA VP of Finance 2012 - 2013 Highlights: Played a key role in multiple funding rounds, effectively managing relationships with VCs to ensure alignment and ongoing growth Spearheaded the ground-breaking introduction of the industry’s first Elastic Integration Platform as a Service (IPaaS) Directed and managed robust accounting policies and procedures, setting the foundation for stable growth Led and managed the accounting operations, overseeing the collection of financial data, international consolidation and internal process improvements Prepared monthly and quarterly financial reports for executive team and investors Managed worldwide HR and Employee experience to bring HR metrics and headcount to the forefront of company priorities Managed HR support, online training, recruiting, onboarding and benefit administration, including extensive work with H-1B visas and employee relations Managed internal accountants overseeing general accounting, payroll, tax, and compliance in the UK Xiox San Mateo, CA  Chief Financial Officer - CFO 2001 - 2011 Highlights: Led the company through a successful Ch 11 reorganization and privatization process, negotiating with creditors and steering the organization back to profitability. Achieved operating expense reduction of 40% through the implementation of cost-containment measures Managed contract, contract negotiations with customers, especially during the period where deferred revenue for software sales was a highly debated issue Maintained Shareholder and Investor relations, compiling information for Board of Directors’ meetings, Shareholders’ meetings and proxy mailings Prepared monthly and periodic financial packages, including 10-Q, 10-K, 8-K and Annual Report Managed all aspects of financial strategy on a worldwide basis to include subsidiaries in the US and Europe BUSINESS SOFTWARE NetSuite, Great Plains Dynamics, Sage, Quickbooks, Peachtree, Concur, ADP, Paychex, Ultipro, Zendesk, Power BI, Zone, Tableau, FloQast, Salesforce EDUCATION San Francisco State University Masters of Business Administration MBA - Finance Bachelor of Science BS - Accounting & Finance Stanford - Hawk Ridge System ASSOCIATIONS & PROFESSIONAL CERTIFICATIONS Corporate Sponsor - Women’s Empowerment Group - Hawk Ridge Systems Corporate Leadership - DEI Council - Hawk Ridge Systems Corporate Development - HawkReach - Hawk Ridge Systems Global Leadership - VAR Finance Council - Hawk Ridge Systems Corporate Evangelist - Lucile Packard Children’s Hospital at Stanford - Hawk Ridge System', '{"basics": {"email": "irisc0305@gmail.com", "phone": "780-6618", "social": [], "lastName": "Chiu", "linkedIn": null, "location": {"city": "Mountain View", "state": "CA", "country": "USA"}, "fi