	('02e01135-7a19-4a75-b433-5eb22daf622d', '2024-10-23 11:21:13.443881+00', '608a10f1-5c3c-4ab6-baa8-8c6551cd3d96', 'https://ecfwsyxpcuzxlxrkhxjz.supabase.co/storage/v1/object/public/resume-job-post/public/2bb3a533-1245-49c1-87e0-2c487a875ae9.pdf', 'Steven L. Emberland, CPA Saratoga, CA 95070 / Cell: 4086215 semberland@gmail.com PROFESSIONAL SUMMARY Big 4 alum, change agent, and finance & operations executive experienced in leading and building teams to scale and driving value creation ♦ Track record of establishing executive and cross-functional collaboration to deliver results ♦ Public company/IPO readiness ♦ Cost reductions/driving operational efficiencies ♦ Proven expertise in leading strategic FP&A, treasury, tax, accounting, cash/banking, financial/SEC reporting and revenue recognition. Skilled in directing human resources, facilities, office administration and procurement ♦ Fund raising and investor relations Internal communications ♦ Mergers & Acquisitions ♦ Team leadership & development ♦ ♦ Performance management and culture ♦ Public and private/startup experience ♦ Domestic and international operations (Japan, China, Canada, Ireland, Germany, and France) Industries include SaaS/B2B software, healthcare, hardware, and telecommunications ♦ Adept at streamlining, best practices, process ♦ improvements, internal controls, and compliance ♦ Risk management PROFESSIONAL EXPERIENCE Senior Finance and Operations Consultant Providing strategic financial, operational, and corporate consulting services to technology companies. Streamlining operations, securing funding, and driving strategic objectives. Sep. 2024 - Present Core Areas of Expertise Include: • Financial Strategy & Management: Develop and implement financial strategies, manage cash flows, lead FP&A initiatives, facilitate fundraising, prepare and deliver Board presentations, and manage IPO readiness • Accounting & Reporting: Deliver controller-level services, streamline month-end close processes, lead financial and SEC reporting, coordinate annual audits, and manage 409A valuations • Operational Efficiency: Enhance operational processes, implement and optimize financial systems (e.g., NetSuite), and offshore resources to optimize headcount and reduce costs • Corporate Services: Advise on HR strategies, manage treasury operations, and coordinate income tax filings and transfer pricing implementation and compliance Carrot Fertility, Inc., Menlo Park, CA/Fully Distributed (Privately Held) Senior Vice President, Finance/Senior Leadership Team Healthtech/Global benefits platform, fertility & family-building care ($100M+ARR) Aug. 2023 - Jun. 2024 • Launched initiatives within Finance that significantly elevated eNPS scores, exceeding company averages, and earning high marks in areas such as constructive feedback, trust in management, and clarity of job purpose • Collaborated with executive team to create FY25 budget with strong growth and accelerated path to profitability • Uncovered up to $10M/year in missed Carrot Plan billings for journeys from member relatives • Cash burn reduced by $30M by eliminating low ROI initiatives, streamlining the GTM function, eliminating redundant headcount, and improving the compensation structure to align with a fully distributed workforce • Raised $35 million in debt financing to support company operations and extend runway if needed • Partnered with CX leadership to improve the management of expansion bookings, resulting in precise definitions, calculations, enhanced reporting and timely communication • Collaborated with Growth & Engagement leadership to develop the proper incentives for Sales to include marketing rights to members on new logo deals • Developed a multi-year sales capacity model to empower Sales to plan and optimize headcount, model quotas by territory, and allocate sales support resources to meet new logo targets • Designed and implemented a renewal calculator for the CS team, streamlining tiered pricing negotiations and 