live in February 2023 • Served as the change management catalyst, driving and facilitating organizational change to ensure a smooth transition and adoption of the new platform • Benefits include enhanced internal controls, streamlined processes, and expected cost savings totaling 6% during the first twelve months • Streamlined the month end close, reducing the timeline from 3 weeks to 6 days by implementing efficient workflows and processes, adding headcount in key areas, and utilizing automation tools • Oversaw and managed a successful first-year Big 4 AICPA audit utilizing PCAOB selection and materiality criteria (FY22) • Resolved a four-year delinquency by successfully updating and bringing current transfer pricing documentation for 9 countries • Coordinated a sales tax nexus update, ensuring accurate billing, collection, and remittance of sales taxes, improving compliance, minimizing risk of penalties and interest, and reducing the number of registered states • Streamlined the workflow and communications for international stock option exercises, improving compliance and reporting, cash flows between entities and eliminating FX risk J2 Global/Consensus Cloud Solutions, Inc., Los Angeles, CA (NASDAQ: CCSI) Vice President, Corporate Controller & Principal Accounting Officer (Section 16 Officer) Software/Interoperability and Secure Data Exchange utilizing NLP & AI Sep. 2021 - Mar. 2022 CCSI spun off from J2 Global (now Ziff Davis NASDAQ: ZD) as a $350M/year publicly traded company in October 2021 • Finance executive and core team member helping to drive and execute the successful Consensus spin-off from J2 Global by providing financial expertise and support throughout the process, including P2P Oracle set-up and data validation, technical accounting, internal management reporting and SEC reporting • Core team member and finance representative for the company’s first acquisition (Summit Health) that included due diligence, financial analysis, contract review and risk assessment • Established banking and treasury processes, policies, and procedures for all disbursements with two large commercial banks including wire releases, ACH payments, and payables • Created the framework for non-GAAP reporting to be used in quarterly and annual press releases • Set up the worldwide consolidations and intercompany accounting and reporting utilizing an Excel add-in that connects to Oracle Fusion • Prepared the team to complete the company’s first month-end close as a public company including: • Establishing a comprehensive month end close checklist • Reviewing and approving balance sheet reconciliations and journal entries • Working closely with internal audit to ensure the company implemented and adhered to SOX- compliant internal controls • Evaluated all US and Europe personnel in accounting operations, accounts payable and treasury. Promoted two leaders in each geo to accounting manager to improve organizational structure and hierarchy SoundHound AI, Inc., Santa Clara, CA (NASDAQ: SOUN) VP, Finance & Administration/Executive Team & Acting CFO/CAO (Promotion) Corporate Controller Software/Voice-enabled AI and Conversational Intelligence Aug. 2018 - Sep. 2021 Apr. 2013 - Jul. 2018 • As the company’s top finance leader for over 8 years, helped propel the company to a $2B valuation through strategic financial management and operational excellence • Strategic role and core team member in public company/SPAC readiness including completing PCAOB audits (FY 2019 & 2020), developing multi-year projections and assisting in SPAC presentations • Core team member in executing Series C-1 through D-3 equity financing totaling over $200M • Successfully raised $30 million in debt financing to support company operations and extend runway • Hired and developed key staff to provide leadership over finance, human resources, accounting, real estate & facilities, and office management to support global expansion (headcount increased 6x and valuation 15x since 20