d finance representative for the company’s first acquisition (Summit Health) that included due diligence, financial analysis, contract review and risk assessment. Established banking and treasury processes, policies, and procedures for all disbursements with two large commercial banks including wire releases, ACH payments, and payables. Created the framework for non-GAAP reporting to be used in quarterly and annual press releases. Set up the worldwide consolidations and intercompany accounting and reporting utilizing an Excel add-in that connects to Oracle Fusion. Prepared the team to complete the company’s first month-end close as a public company including: Establishing a comprehensive month end close checklist. Reviewing and approving balance sheet reconciliations and journal entries. Working closely with internal audit to ensure the company implemented and adhered to SOX- compliant internal controls. Evaluated all US and Europe personnel in accounting operations, accounts payable and treasury. Promoted two leaders in each geo to accounting manager to improve organizational structure and hierarchy."}, {"end": {"year": 2021, "month": 9}, "org": "SoundHound AI, Inc.", "level": "Senior-level", "start": {"year": 2018, "month": 8}, "title": "VP, Finance & Administration/Executive Team & Acting CFO/CAO (Promotion)", "location": "Santa Clara, CA (NASDAQ: SOUN)", "description": "As the company’s top finance leader for over 8 years, helped propel the company to a $2B valuation through strategic financial management and operational excellence. Strategic role and core team member in public company/SPAC readiness including completing PCAOB audits (FY 2019 & 2020), developing multi-year projections and assisting in SPAC presentations. Core team member in executing Series C-1 through D-3 equity financing totaling over $200M. Successfully raised $30 million in debt financing to support company operations and extend runway. Hired and developed key staff to provide leadership over finance, human resources, accounting, real estate & facilities, and office management to support global expansion (headcount increased 6x and valuation 15x since 2013). Reduced cash burn by implementing aggressive cost savings strategy that included slashing costs, capping monthly spend and negotiating discounts resulting in over $14M saved versus budget. Launched departmental budgeting, reporting and analysis initiative to improve cost containment and provide greater accountability around corporate spend. Developed, monitored, and reported on select KPI’s to executive team. Partnered with executives in developing and implementing initiatives, annual goals, and strategies to achieve growth. Initiated and led an international expansion committee to ensure treasury, tax, HR, payroll, and accounting functions were aligned with legal and strategy, resulting in three new international locations within 18 months. Established policies, procedures, and processes for international onboarding in China, France, and Germany. Executive team member responsible for defining core values and shaping company culture."}], "certificates": []}', NULL, NULL, NULL, NULL, 'resume'),
	('e064d083-a617-4af1-b014-848d9bb06a8e', '2024-10-23 11:21:13.411699+00', '6c70499d-e1ec-4ac4-a05d-efa3e00cf5bc', 'https://ecfwsyxpcuzxlxrkhxjz.supabase.co/storage/v1/object/public/resume-job-post/public/df0bdde6-8986-4d48-b9fd-8767f4e64bda.docx', 'Gregg Lakritz, CPA, MBA Mobile:  504 9239; San Jose, CA, Email: lakritzg@gmail.com Summary  IPO experience from initial public company readiness through flawless years one and two SOX.  Implemented software, SaaS, and hardware revenue recognition under ASC 606.  Broad experience in strategic decision-making, cost reductions and advanced SEC reporting. Process simplification expertise including improvements in accounting close and forecast processes.  Established robust controls within SOX Section 404b framework.  Finance and accounting leader of company-wide ERP software implementations and integrations.  Established significant U.S., Swiss and Taiwan shared service centers from the ground up.  Broad acquisition analysis for 60+ international manufacturers and software providers. PROFESSIONAL EXPERIENCE  BioLife Solutions 1/23 to 11/23  Rapidly growing global health science industry leader (BLFS on NASDAQ).  VP Corporate Controller Technical accounting/reporting, M&A, equity, cost/factory finance, AP, payroll, international, credit/collections, internal/external audit, ERP ownership.  Integrated six acquired entities into financial processes including NetSuite ERP. Reorganized global team to functionally-based, from entity based, based on shared service concepts. Dramatically streamlined the close-the-books process. Created monthly executive finance package. Evaluation of strategic alternatives, including sale, discontinuation or licensing of under-performing business units. Corsair 11/17 to 12/22  Took pre-IPO unicorn public (CRSR on NASDAQ) with multi-billion dollar valuation. PC gaming components and peripherals. $2B in sales including B2C e-commerce and B2B.  Principal Accounting Officer, VP Corporate Controller Hired to join leadership team to lead public company readiness on a company-wide scale.  Drove financial sections of S-1 filing, first press release and 10-Q. Revenue, international, equity, SEC, cost, M&A, general accounting, shared service center, internal audit (doubled global accounting team to 75 employees). Constructed comprehensive system of internal controls.  System implementations including ERP integrations, equity platform (Equity Edge Online), purchasing platform (Coupa), T&E (Concur). Lead team to implement ASC 606 and ASC 842 and all other new accounting guidance. No significant control deficiencies during first year SOX as public company.  Trimble 7/17 –10/17  Senior Strategic Consultant  Managed resources to produce worldwide recast of historic revenue. Evaluate, select and communicate optimal approaches to ASC 606 adoption, balancing efficiency and controls. Work with internal technical accounting team to determine applicable ASC 606 technical guidance for Trimble’s historic and recently acquired revenue streams. Determine and implement appropriate processes, systems and review controls for ongoing ASC 606 reporting/disclosure.  Harmonic Inc. 9/11 –6/17  Video delivery hardware, software and subscription services (HLIT on NASDAQ) with $600M in sales.  Chief Accounting Officer, VP Corporate Controller Report directly to the CFO, leading all worldwide accounting, cost accounting, revenue, SEC, M&A, shared service center, internal audit and all tax functions.  Retained a lean accounting team as the company grew.  Conducted sweeping overhaul of cash conversion cycle that lead to best in class performance.  Helped drive dramatic increase in SAS and other software revenue. Establish agenda, lead and chief presenter at all audit committee meetings.  Drove over 50% reduction in close cycle time by minimizing manual activities.  Created leading-edge European shared service center.  Designed foreign exposure hedging process that reduced currency exposure by 90%. Successfully concluded comprehensive, multi-year IRS audit.  Key member of team that successfully drove $125M convertible bond offering.  Ownership of sales forecasting process. Drove rapid integration of major acquisition including full Oracle integration within three quarters. Trimble 10/05 – 9/11  Global positioning hardware, Saas and software (TRMB on NASDAQ). During tenure, sales grew from $0.4B to $2.5B.  Corporate Controller Expanded and mentored team of 50+ accounting professionals including SEC, revenue, international finance directors, general ledger, consolidations, M&A, A/P, payroll, treasury accounting and commissions. Active involvement in over 60 public and private software and hardware acquisitions, several major divestitures, numerous complex financing arrangements and major joint ventures.  Documented revenue recognition positions for complex hardware and software (SAS) revenue arrangements.  Efficient and accurate monthly consolidation of over 100 legal entities in Americas, APAC and Europe. LTX – Credence 4/03 – 10/05  Rapidly-growing maker of semiconductor test equipment and software (LTXC on NASDAQ) with sales of $600M. Director of Accounting Managed general ledger, international accounting, receivables, payroll, A/P, internal audit and all SEC reporting.  Filing of convertible bond offering and all other acquisition-related SEC filings. Mattson Technology 4/02 – 3/03  An international, public high-tech manufacturing company (MTSN on NASDAQ) with $300M in revenue. Vice President, Corporate Controller In charge of all divisional finance, cost accounting, SEC and accounting functions.  Established comprehensive system of internal controls and lead for all Sarbanes-Oxley activities.  Re-designed close process resulting in 40% shorter cycle with fewer headcount.  Drove cost reduction initiatives including closure and sale of redundant and low performing entities.  Orchestrated finance reorganization that greatly improved efficiency and operational support.  KLA-Tencor 4/99 – 3/02  Leader in semiconductor factory automation and test equipment (KLAC on NASDAQ) with over $3B Revenue. Assistant Corporate Controller  Led entire accounting organization (35 professionals) including Finance IT, general ledger, SEC and Internal Audit.  Established intuitive transactional accounting metrics which drove accounting group toward world-class performance.  Responsible for interpretation and implementation of all GAAP and worldwide internal accounting policies.  Drove exhaustive increase in use of system-based, as opposed to manual, internal controls. Established accounting and internal controls for $100M venture fund. Headed due diligence and drove integration for several major acquisitions.  Cypress Semiconductor 2/97 – 3/99  A $2 billion semiconductor manufacturer (CY on the NYSE). After one year, promoted from Division Controller to Group Controller, responsible for all accounting and FP&A for over 60% of company operations.  Group Controller  Supplied four operational VPs with intuitive metrics to exceed strategic and tactical business plans.  Created financial model to fine-tune company’s technological roadmap and measure success of R&D projects.  Implemented process to identify root causes and corrective actions to reduce company-wide inventory.  Project lead on cross-functional team to reduce breakeven revenue levels.  Provided all accounting and financial support for Cypress’s five product lines.  Created from scratch, a project-based budget and accounting system for cross-divisional resource management.  Analysis of technical roadmap caused shift from investment to milking strategy for major product line.  Performed analysis to de-feature product to fill product line hole and allow participation in lower-priced regions.  Created separate segment-based P&Ls used to refine product line strategy.  Applied Materials 7/95 – 1/97  The world’s largest manufacturer (AMAT on Nasdaq) of semiconductor equipment with annual revenue of over $6B.  Finance Manager , Group Accounting Manager   Directed close, forecast and annual plan for company during period of explosive growth.  Led staff to reduce time to complete financial forecast by over 50%.  Played key role in company-wide SAP and implementations.  Developed total cost of ownership (COO) model used by Strategic Marketing to benchmark competitors’ products. Intel 6/87 – 6/95 The world’s largest chip producer. Attained 8 years of increasing responsibility managing strategic finance teams. During tenure, sales grew from $1B to $40B.  Sr. Manager – Worldwide Capacity and Loading Finance (8/6/95)  Managed group of 7 senior analysts dedicated to optimizing worldwide factory capacity and loading decisions. Controlled a $3B annual capital budget for new factory capacity and equipment. Provided all financial modeling and support for factory site selections, factory expansions and factory closures. Manager - Financial Strategy (4/7/94)  Determined all pricing and manufacturing strategies for Intel’s multi-billion dollar Memory Components Division. Created new high performance finance team including all hiring, direction-setting, and alignment with operations.  Led FP&A effort including division’s first comprehensive long-range planning model. Conducted initial feasibility studies for Flashcard and Flashdrive product startups.  Performed analysis that resulted in move from contracted to lower cost in-house assembly line. EDUCATION & ACCREDITATIONS  MBA – University of Wisconsin BBA Accounting – University of Wisconsin – Milwaukee Graduated Summa Cum Laude  Certified Public Accountant (active CPA license)', '{"basics": {"email": "lakritzg@gmail.com", "phone": "504 9239", "social": [], "lastName": "Lakritz", "linkedIn": null, "location": {"city": "San Jose", "state": "CA", "country": ""}, "firstName": "Gregg", "currentCompany": "BioLife Solutions", "currentJobTitle": "VP Corporate Controller", "totalExperienceInMonths": 396}, "skills": [], "schoo