	('69e63b49-f74a-4db2-9f70-e8cc2d51eb4d', '2024-10-23 11:21:13.426105+00', '76411d15-79af-4220-b3f8-d2f3f8c3e31f', 'https://ecfwsyxpcuzxlxrkhxjz.supabase.co/storage/v1/object/public/resume-job-post/public/a5b6ac95-5083-491c-8b35-88c5338ff834.pdf', 'Deblina Mondal, CPA Santa Clara, CA •  769-7800 • deblina.mndl@gmail.com WORK EXPERIENCE Exabeam Inc. Series F B2B SaaS cybersecurity start-up with ~400 million in preferred funding and ~500 employees VP, Finance (2024 – Current), Controller (2022 –2024), Director, Accounting (2021 –2022) 2021 – Current • Led the Company’s Finance department with a team of ~20 employees across FP&A, Revenue, Order Management, Accounting Operations, Technical Accounting and Payroll. • Contributed to financial due diligence for debt financing and M&A exit. • Managed investor relations. • Developed processes around procurement (including designing Coupa approval workflow), expense accruals, and employee reimbursements. • Developed and managed corporate treasury policy. • Managed compliance with debt covenants. • Designated Finance lead for cross-functional projects including: o Developing systematic tracking of cloud costs for determination of customer margin, o Designing playbook for contract terms, contract approval workflow, and customer overage billing policy, o Structuring product skus and establishing discount ranges, o Developing equity compensation policy including Option and RSU, o Designing policy around approval of employee compensation changes. • Managed corporate insurance policies (D&O and E&O). • Led preparation of Board materials and was responsible for communication to the Audit Committee. • Managed financial reporting and technical accounting including ASC 606 revenue recognition (SaaS, license, services, hardware, and training); ASC 340 commission capitalization; ASC 842 lease accounting; ASC 718 share based compensation including common stock valuation (BSM), tender offer, option repricing and secondary sales; ASC 350 cap