s, internal and external, to produce financial reports and provide information for MSB (money service business) licensing compliance requirements at Federal and State levels. Support the application for the company’s first MTL’s (money transmitter licenses), gaining approval in 12 states. Work with external consultants to prepare two purchase price allocations and five 409A valuations. Consolidate company and wholly owned subsidiary financials, preparing intercompany and elimination entries. Play a key role in dissolving 6 domestic and international entities. VIZ Media, LLC June 2019 to March 2020 Media and entertainment company specializing in manga publishing, animation, and licensing, $110M in annual revenues Controller and Senior Director, Accounting Returned to company to lead Accounting function after CFO and Controller left. Oversee the Accounting team of five, responsible for G/L Accounting, Balance Sheet, A/P, A/R, Payroll, Purchasing, Inventory, Cash Management, Audit and Tax compliance. Met monthly with management team to review financial results and key issues. Oversaw month-end close process, working with and reviewing work of senior, staff, and payroll accountants. Dealt with departure of two full-time team members, finding qualified temps to fill roles, and coordinating training. Callisto Media, Inc. June 2016 to June 2019 Fast growing, data-driven start-up publishing company, $50M in annual revenues Director of Finance, Controller Managed Accounting, A/P, A/R, payroll functions, cash flows, financial reporting, 401k compliance, equity administration, reporting to investors, bank relationships, and ensured corporate compliance over tax and insurance. Helped scale processes and procedures, and delegate functions, as company continues to increase headcount, from 34 to 150, and growing. Provided high-level P&L summary by workday 2 to CFO and CEO. Developed and reported key corporate and SAAS metrics. Directly managed Senior Accountant and offshore accounting team. Controller Prepared delegation of authority and employee T&E policy, documented all standard operating procedures in Finance, oversaw financial statement preparation. Managed offshore accounting team (India). Assumed full responsibility over Finance when VP, Finance left company, between September 2016, and March 2017. Led company through first two years’ financial audits, done by KPMG, with clean, unqualified audit opinions. Verified accuracy of A/P, A/R, P/R, and G/L accounting postings, and authorized payments to vendors, employees. Prepared financial board documents, and weekly sales reports, reporting directly to the CEO. Generation Tux, Inc. October 2014 to August 2016 Innovative, start-up men’s formal wear company, $1M in annual revenues Controller Built accounting specifications for pre-launch e-commerce site, interconnecting disparate bill payment and cash receipts systems, oversaw financial statement preparation, reviewed payments. Obtained $2.5 million operational term loan, $2.5 million line of credit, and $680K letter of credit. Led company through first year financial audit with clean, unqualified audit opinion. Reviewed monthly financial results with CFO, and all operational department managers, identified key variances. VIZ Media, LLC August 2008 to October 2014 Media and entertainment company specializing in manga publishing, animation, and licensing, $60M in annual revenues Senior Director, Finance Oversaw the Finance team, responsible for accounting, financial and royalty reports, A/P, A/R, Payroll, Purchasing, Royalty, Inventory, FP&A, budgeting, cash management, audit and tax compliance. During corporate reorganization, reduced Finance headcount by two, saving $170K in payroll. Managed cash flows, reducing S/T loan payable to bank by $5 million, saving $75K in interest. Met monthly with CEO and COO, presenting and explaining the financial results and key issues. Led Finance effort to tighten administrative expenses, contributing to first profitable fiscal year in several years. Controller Managed the month-end close and team of five, prepared financial statements for executive team and operating committee. Improved the accuracy and timeliness of accounting and reconciliations. Examples include correcting the accounting for fixed assets and depreciation, utilizing templates to expedite journal entry postings, and getting current on four years of bank reconciliations that were not done previously. Supervised the system upgrade and transition of data from Oracle version 11i to R12, and from Oracle to Data Intensity servers, checking for data integrity. Posit Science Corporation February 2006 to July 2008 Start-up software company offering research-backed brain-training exercises, $12M in annual revenues Manager of Accounting Prepared journal entries, reconciliations, royalty reports, and financial statements for VP of Finance and investors (VC firms). Created first set of policies and procedures on accounting, revenue recognition, inventory management, and purchasing for the company. Advised VP of Finance, VP of Sales, and CEO on revenue recognition (SOP 97-2), while reviewing potential agreements with customers. Developed and reported on weekly key corporate metrics covering sales by market segment, employee utilization, and inventory management. Waste Management May 2004 to February 2006 Large public company offering environmental services, $40M in annual revenues for Alameda County business unit Senior Accountant Supported the Accounting Manager in leading a six-day month-end close. Performed all accounting and variance analyses for three business units. Led the accounting department in collecting and reviewing supporting documentation from the accountants and testing for Sarbanes-Oxley (SOX) United Behavioral Health August 2002 to April 2004 Large public company offering mental health services, part of UnitedHealth Group, $720M in annual revenues Senior Accountant Performed accounting for Health Plan division, coordinating work of other accountants during a four-day month-end close. Assisted multiple departments in preparing corporate budget. Conducted monthly meetings with regional VP''s to discuss revenue and expense variances. Innovative Education Management December 1999 to August 2002 Non-profit education management company providing all services to charter schools, $5M in annual revenues Controller Performed accounting and financial reporting for the non-profit organization including the charter schools it managed, oversaw A/P and Payroll functions. Led the company’s first annual audit, leading to an unqualified (clean) audit opinion in 2001. Helped prepare budgets for the organization and all the charter schools. Healthdent of California January 1998 to December 1999 Senior Accountant Searson & Company, CPA''s September 1995 to December 1997 Senior Auditor Macias, Gini & Company, CPA''s June 1994 to September 1995 Staff Auditor Medical Clinic of Sacramento January 1991 to June 1994 Staff Accountant Education & Certification California State University, Sacramento Bachelor of Science, Accountancy Graduated Cum Laude, member of Beta Alpha Psi and Golden Key National Honor Society Certified Public Accountant, California Active Status American Institute of Certified Public Accountants', '{"basics": {"email": "mikefong81@gmail.com", "phone": "325-9024", "social": [], "lastName": "Fong", "linkedIn": "https://www.linkedin.com/in/mike-fong-cpa-0621804", "location": {"city": "San Leandro", "state": "California", "country": ""}, "firstName": "Mike", "currentCompany": "Metallicus, Inc.", "currentJobTitle": "Controller", "totalExperienceInMonths": 314}, "skills": ["Software implementation (Financial Force, NetSuite, TaxBit)", "Payroll (ADP, Tri-Net, Gusto)", "ERP (Oracle, PeopleSoft, Financial Force, MAS 90)", "Building and management of accounting/finance teams", "Revenue recognition (SOP 97-2, ASC 605 & 606)", "Budgeting", "Excel (intermediate to advanced)",