	('491a37c5-0393-4bd8-b4fc-a197e5e06c57', '2024-10-23 11:21:13.434454+00', '20e8e68d-f6b4-435c-a813-8d66aed1f421', 'https://ecfwsyxpcuzxlxrkhxjz.supabase.co/storage/v1/object/public/resume-job-post/public/69f190de-348d-4b45-9c3b-dd8692d7ad56.pdf', 'Mitul S. Doshi, CPA, (Active) mitulsdoshi@yahoo.com  644-2927 Senior Finance and Accounting Leader: Seasoned Controller, Operational finance, SEC Reporting, Financial Planning and Analysis • Top performing well-rounded and hands-On Certified Public Accountant, results oriented, performer, very disciplined combined with excellent work ethics. Values accuracy and teamwork and trains staff to achieve common company goals. Works well with all levels of management. Has a unique ability and background to blend in any kind and level of accounting role and work the way through to achieve common business objectives. AREAS OF EXPERTISE AND SYSTEMS SKILLS Areas of Expertise US GAAP IPO Due Diligence, SPAC External Audits External Tax Filings (Corporate & State) set up and International subsidiary management SOX Implementation and Management Systems Skills Oracle, Net Suite, SAP, Quick Books Hyperion, FRX Report Writer Google Sheets & Docs Microsoft Excel, Word, Power Point Merrill Bridge SEC filing portal Merrill Bridge SEC Section 16 Connect EDUCATION AND PROFESSIONAL QUALIFICATIONS • California CPA credential (Active), general license, Form G. • Master of Science in Accounting, Bentley College, Waltham, MA. • Bachelor of Commerce, Accounting Major. University of Bombay, India. 1 PROFESSIONAL EXPERIENCE Presto Automation Inc. May 2021-Present Restaurant Technology Business offers AI digital voice and vision solution to hospitality businesses. Head Count=165 Employees, Revenue=$30M Annually Achievements: Completed 2 years of PCAOB audit and Implemented Net Suite in 7 months of starting with the Company, SPAC process, Filed Form S-4, Built a full functioning Accounting Team, Stood up public facing SEC reporting function, Managed Technical Accounting Team, reduced close cycle to 10 days from 30 days, documented accounting processes and trained a very lean accounting team for public readiness, Helped onboarding senior level functions including interim CFO and Operations roles. Corporate Controller • Worked through the SPAC IPO process and merger accounting. • Built and trained very lean accounting team for public readiness (3 accountants) • Completed 2 years of audit including full equity accounting and completed technical accounting positions for certain business situations for the company. • Completed NetSuite Implementation of Core Financial Statements within 2 months in parallel to annual audit and a successful SPAC process. • Successfully stood up the SEC function • Onboarded Operations function and legal function while the leadership was going through changes, successfully transitioned CFO and was accommodating CFO responsibilities until replacement. Inventory Accounting Clean Up and developing controls for inventory costing and reconciliation process. • • Successfully and strategically suggested action plan for SOX design and planning process. • Completed technology acquisition of a small company during the SPAC process. • Provided leadership in implementing and documenting processes to highlight gap and risks within the financial reporting process. • Formed international subsidiaries and recommended legal and tax structure. • Responsible and managing third party tax accountants and tax filings for the company. • Worked on fair value of convertible debt and understanding inputs and Monte Carlo simulations. • Worked through Customer pricing arrangements and tightened and implemented sales commission plan. 2 Signifyd, Inc. October 2016-May 2021 Ecommerce SAAS Company, privately held. Privately held Ecommerce SAAS Company Head Count=270 Employees, Revenue=less than $100M Annually Achievements: Process Improvements on the operational side of the business, completed first audit for the Company with minimal resources and reduced the close time from 15 days to 8 days and implemented NetSuite with various software integrations, along with international operations set up. Director of Finance (Revenue and International Operations) Revenue Operations • Manage Revenue and International Operations • Manage cash flow by managing the SO to cash process (Increased collections Efforts and decreased DSO by 8 days cash flow increased by $300K a month) • Create effective credit policies to manage customer payment terms. • Revenue Forecasting and analyzing revenue streams and customer margins determining ASC 606 Revenue application. • Cash Forecasting and financial statements • Handling Enterprise Customer Accounts and determining accounting treatment. • Determining losses on Customer Accounts to help in determining customer margins. International Operations • Set up Brazil and Mexico Operations and Set up • Determine legal process of the set up and hire relevant service providers. • Work with local accountants on legal, HR and Accounting Compliance Other Responsibilities • Responsible for managing year end audit. • Responsible for managing tax fillings. • Any audit and tax compliance issues • Managing risk and insurance policies for the Company Controller • Build and manage an accounting team to address business needs. • Managing 4 direct reports on the operational side of the business, charting out business process flows to maximize resource utilization. • Able to create processes on the operational side of the business to maximize efficiency. • Manage external auditors and tax accountants-completed first company audit. • Develop documentation and provide GAAP guidance for business transactions, in the absence of high- level accounting professionals. Improvise existing processes to scale with the growing business needs. • • Facilitate Financial Planning and business modeling needs. • Maximized resources and developed process efficiencies to bring the close days down to 8 days from 15 days. • Suggested system implementation and resource planning and completed NetSuite Implementation 3 Aquantia Corporation, Milpitas, CA. March 2012-July 2016 Fabless Semiconductor Company privately held. Head Count=250 Employees, Annual Revenue=$180M. Achievements: Filed first S-1 for the Company with limited resources while being the Controller for the Company. Received CEO Award for taking Ownership and Responsibility. Corporate Controller • Built and trained an accounting team of 6 people in various accounting functions to manage growth. Provide oversight and direction to all accounting levels and international subsidiaries. Implemented internal controls and processes surrounding the financial statements reporting and general ledger. Write and Implement accounting policies and procedures. Maintain internal audit processes. Implemented processes with the newly created sales order team and worked with the Inventory group to bring the Manufacturing system live. • • • Managed system implementation project and organized the group to best achieve efficiency and productivity. • Management of 2 subsidiaries to ensure consolidations and subsidiary ledgers adhere to GAAP requirements. • Managed Internal and external audit, including directing and working with all levels of auditors to achieve efficiency. • Worked on debt agreements and revenue contracts with certain customers on revenue recognition issues. • Worked on financing agreements to achieve best financing terms to align with business environment and business needs. • Responsible for leading month end closes and preparing full set of financial statements and management and investor packages. • Manage general ledger, accounts payable and stock administration and payroll. • Make system improvements and suggestions and streamlining processes to optimize resources. • Manage tax return preparation and handle technical memos as the business situation arises. • Manage chart of accounts as the company entered production stage and make suggestions to eliminate manual processes. • Write position papers on contract revenue accounting with multiple deliverables. Also responsible for writing technical memos and position memos for technical issues facing the business, including capitalizing inventory on books and recording research and development expenses. • Work on financial forecasts, budgeting, and planning with CFO to create financial models. • Closely worked with Human Resources to set up benefits plan and bonus plan to best align with business objectives. 4 Calix, Inc. Petaluma, CA October 2008-March 2012 (Acquired Occam Networks, Inc.) Calix, Inc. designs and develops broadband communications equipment. Size; Annual Revenue: approximately $287 million and approximately 600 employees. Calix completed Occam Network’s acquisition on February 22, 2011. Achievements: Contributed to Fair value Accounting of Purchase Price Allocation of stock options and achieved external reporting process finalization for the Company. SEC & Technical Accounting Manager Responsible for all SEC filings, Technical Accounting and Equity Accounting. • Responsible for drafting and filing of the Forms 10-Q, 10-K, 8-K, S-8, Def 14A. • Responsible for all XBRL related matters. • SOX compliance related to external reporting process and equity. • Responsible for coordinating external reporting with external auditors. • Worked on Topic 805 and Topic 718 in connection with the merger. • Worked on technical accounting memos related to revenue recognition policy, restricted stock awards and other merger related matters. • Worked on technical position paper on performance related grants and its application and drafting related disclosures. Occam Networks, Inc. Fremont, CA. (Acquired by Calix) Until - Feb 2011 Occam Networks, Inc. designs and develops broadband communications equipment. Size: Annual Revenue approximately $90 million and approximately 190 employees. Manager - SEC & Technical Accounting Responsible for all SEC filings, Equity Accounting and Administration and researching technical accounting issues and applying to actual business situations. External Reporting Responsibilities • Responsible for managing and filing of quarterly and annual reportsQ, 10-K, S-8, Proxy, Filing of Forms 4, Forms 3. Setting up proxy dates and working with the lawyers on disclosure items. Successfully cut down the filing costs significantly by streamlining the entire external reporting process. • Worked on merger related communication reporting and Form S-4 and coordinating with lawyers and auditors on various documents and comments. • Research various disclosure related matters and SEC and GAAP disclosure requirements. Successfully was able to arrive at conclusions on various technical matters. • Update new technical and disclosure matters related to specific business needs. • Responsible for coordinating the flow and information on the Earnings Release and Conference Call Script. • Working with the external auditors and lawyers closely on resolving their questions and comments related to external reporting and coordinating audits and reviews with internal members and the auditors. 5 Technical Accounting Responsibilities • Writing and updating technical memos on various technical matters such as Revenue Recognition-SAB 104, SFAS Topic 718(SFAS 123R)-Accounting for stock-based compensation-Performance Awards and Forfeiture Rate Application and Analysis, SFAS 146, Accounting for Costs Associated with Exit or Disposal Activities, SFAS 5 – Accounting for Contingencies, SFAS 109 & FIN 48-Accounting for Income Taxes- Reviewing and helping tax accountants to get correct information for tax compliance. SFAS 157 –Evaluating implementation for other assets and liabilities. Involved in research on warrants granted and outstanding and suggesting adjusting entries and related disclosure requirements. • • Directing general accounting team on GAAP and technical compliance. General Accounting Responsibilities: • Responsible for managing stock administration function and equity accounting including SFAS 123R valuations and accounting. Also responsible for shareholder inquiries and communication. • Responsible for preparing Financial Statements for external reporting. • Responsible for improving and increasing the efficiency of the internal processes in External Reporting and Equity Function. • Directly worked with lawyers on reconciling equity reserves. • Assisting and supporting the tax accountants on providing various tax related documents. • Other Special Research Projects as assigned. Centillium Communications, Inc. Fremont, CA. May 2006-Oct 2008 Centillium Communications, Inc. develops designs and markets, systems on a chip solution for various broadband access infrastructures. Size: Approximately 200 employees (before Transwitch Acquisition), Quarterly Revenue approximately: $6 million. Achievements: Built and trained a general accounting team. Accounting Manager • Managing and supervising stock administration, equity accounting, subsidiary functions, and general ledger functions. Managed a staff of two in the accounting department. • Closely managing accounting close function, including account reconciliations and financial statements for internal reporting. Also proposed ways to refine the closing process for a more efficient closing. Also responsible for co-ordination and timing of the external audits and reviews and responsible for resolving any technical accounting issues. • Managing consolidations and interfacing with six international subsidiaries on various issues. • Responsible for all FAS123R related accounting and related issues. • Preparation of SEC reporting footnotes on the Quarterly and Annual filings, Proxy Statements and Form S-8. • Trained personnel for cash, payroll, general accounting functions and stock administration and utilized available resources in the most efficient manner. Interfacing with the outside tax accountants to provide tax schedules for corporate tax returns. • • Researching and writing technical accounting memos on technical accounting issues such as FIN 48, FAS 157 & FAS 159, FAS 5, FAS 2 and other issues that might arise. • Other special accounting projects as assigned. 6 Avanex Corporation Fremont, CA. May 2003-June 2005 Avanex Corporation, together with its subsidiaries, engaged in the design, manufacture, and marketing of fiber optic-based products. Size: Approximately 1,000 Employees and Revenue Approximately $106 million annually. Achievements: Achieved GAAP consolidations of various entities acquired and assisted in setting up Intercompany accounts and reconciliations. Senior Accountant • • Assist the Controller in SEC filings like the Forms 10-Q, 10-K. Preparation of Financial Statements Footnotes and Support. Work with worldwide locations for information for SEC purposes and interact with the auditors for SEC documents and support. • Maintain and prepare Quarterly GAAP Disclosure checklist. • Responsible for revenue recognition on a worldwide basis. Responsible for reviewing and comprehending customer contracts and terms of shipments on a worldwide basis. • Review procedures for Sarbanes and Oxley testing for responsible sections. • Maintain deferred revenue schedule and reconcile revenue and cost. • Reconcile Intercompany Revenue and Intercompany COGS between locations. • Manage and record intercompany transactions on a worldwide basis and record elimination entries for consolidation purposes. • Responsible for closing entries and Balance Sheet Account Reconciliations. • Special projects as assigned by the Controller. Tripath Technology Inc., San Jose, CA. July 1999-May 2003 Tripath Technology, Inc. designed and sold amplifiers based on their proprietary Digital Power processing technology. Size: 80 employees Annual Revenue approximately: $13 million. Achievements: Assisted the Controller through the IPO due diligence process and helped in successfully filing Form S-1 for the Company. Senior Accountant • Was a key member on the due diligence team for the preparation and documentation of the filing of the form S-1. • Assist the Controller in SEC filings like the Forms 10-Q, 10-K and interact with the auditors for SEC documents and work on special projects assigned by the Controller. • Responsible for driving the entire closing process and achieving process improvements in the monthly closing process by reducing the total time for closing books from 5 days to 3 days. Also responsible for researching technical accounting positions as the situation arises. • Maintain stock options software for grants, exercises and terminations including ESPP transactions. Also responsible for FAS 123 calculations for disclosure requirements. • Responsible for preparing monthly consolidated financial statements package and monthly operating expenses detail for P&L trend and fluctuation analysis. Set up worksheets for translating the international financial statements from local currency to US dollars. Also responsible for interacting with the subsidiary’s accountants for various accounting (US GAAP) related issues. • Work on audit schedules for quarterly reviews and year-end audits. Work closely with the auditors and provide them with the requested schedules and support. 7', '{"basics": {"email": "mitulsdoshi@yahoo.com", "phone": "644-2927", "social": [], "lastName": "Doshi", "linkedIn": null, "location": null, "firstName": "Mitul", "currentCompany": "Presto Automation Inc.", "currentJobTitle": "Senior Finance and Accounting Leader", "totalExperienceInMonths": 276}, "skills": ["US GAAP", "IPO Due Diligence", "SPAC", "External Audits", "External Tax Filings", "SOX Implementation", "Oracle", "Net Suite", "SAP", "Quick Books", "Hyperion", "FRX Report Writer", "Google Sheets & Docs", "Microsoft Excel", "Word", "Power Point", "Merrill Bridge SEC filing portal", "Merrill Bridge SEC Section 16 Connect"], "schools": [{"end": {"year": null, "month"