	('7f05632e-029a-4710-ba5b-938e4cbdb528', '2024-10-23 11:21:13.437037+00', '98ae67ab-ddce-4de8-a8b7-1333fcd4143f', 'https://ecfwsyxpcuzxlxrkhxjz.supabase.co/storage/v1/object/public/resume-job-post/public/0a0f6d5e-a5ad-4b42-bbbe-6f6811f1fc48.pdf', 'IRYNA BUYNYTSKA, CPA Sunnyvale, CA 94087 E-mail: Iryna.Buynytska@gmail.com  718-6964 (cell) SUMMARY OF QUALIFICATIONS  20+ years of experience building and managing global accounting operations and leading international accounting teams (start- ups, pre-IPO, SPAC IPO, public, private companies).  Hands-on experience designing, implementing, and integrating business processes, systems and workflows: Oracle, NetSuite, Great Plains, FloQast, Concur, Carta, Avalara, Expensify, Coupa.  Strong knowledge of US GAAP and IFRS: preparation of consolidated financial statements, audits, SOX, M&A activities. PROFFESSIONAL EXPERIENCE Wonolo, Inc (remote) Corporate Controller Manage global accounting operations and financial reporting including treasury, tax, compliance, and strategic finance. ___ ___September 2022-present __ _  Planned and executed the first audit for the company with no audit adjustments.  Responsible for consolidated GAAP financial reporting, revenue recognition (ASC 606) and non-standard transactions.  Established processes company-wide to assure accurate and timely 4-day EOM close.  Prepare and present finance section materials to the BOD and serve as a point of contact for questions.  Serve as a business owner of several tools integrated with NetSuite, including SFDC, Expensify and Ramp. Drive improvements, integrations, and implementation of automated controls.  Responsible for due diligence, accounting, and integration of the acquired business units. Managed M&A transactions.  Oversee complex processes and related cash flows and banking needs to support domestic and international payrolls.  Established and successfully managed relationships with bankers, auditors, and tax advisors.  Responsible for budgeting and forecasting, variance analysis.  Serve as a finance / accounting advisor to other functions during the roll out of the new and ongoing initiatives. Illumio, Inc (Sunnyvale, CA) Senior Director of Accounting Led international (US, EMEA, Singapore and Philippines) accounting operations, managed EOM close, preparation of financial statements and audits. __ ______ ______________ ___July 2021-August 2022  Managed all aspects of accounting function within controllership organization related to GL, Accounts Payable, payroll, PPE, treasury, investments, taxes, international accounting, consolidation, foreign currency transactions and procurement.  Served as a primary contact and managed annual financial audit conducted by EY.  Served as a point of contact to the Audit Committee, prepared, and presented quarterly and annual financial results.  Implemented FloQast (EOM close and reconciliation tool), strengthened controls and reduced EOM close cycle.  Implemented investments policy and established investing relationship with two asset managers, set up related accounting and reporting cadence.  Responsible for statutory filings and compliance in six international subsidiaries. Worked closely with local accountants  to meet filing requirements (VAT, GST, Income Tax returns, statutory audits). Introduced and onboarded offshore accounting team to support US accounting operations which resulted in cost savings and created operational efficiencies. Implemented GPS, foreign currency purchasing platform, brought savings to the company on foreign currency purchases.   Rolled out a number of NetSuite improvements: non-GAAP and GAAP financial statements, automated allocations. View, Inc (Milpitas, CA) (NASDAQ:VIEW)___ Assistant Corporate Controller Managed SPAC IPO project. Coordinated cross-functional teams and financial advisors and all related activities to prepare the company for SPAC IPO. Completed three years of PCAOB audits, implemented and managed SOX program. Managed financial close, preparation of financial statements and SEC filings and daily accounting operations. ___ August 2020-June 2021  Led, organized and directed all aspects of accounting function related to financial reporting, PPE, treasury and debt, AR and collections, payroll and equity and tax and compliance.  Established and directed timely and disciplined accounting close and financial reporting process.  Managed all aspects of the annual financial audits and quarterly reviews, including serving as the primary contact for the external (PwC) and internal auditors (BDO). Responsible for preparation of the requested information and the overall timeline of the audit activities.  Responsible for timeliness and accuracy of financial information sections of SEC filings (S-4, 10-Qs).  Implemented and managed company’s SOX compliance program, managed internal audit team and related activities.  Monitored accounting activities across the organization including developing policies to ensure compliance with company SOX policies and US GAAP/SEC and other statutory regulations, serve as the owner of a number of ELC controls.  Set the direction for the company’s accounting and business systems to ensure the proper automation (implemented FloQast (EOM close tool) and MetricStream (SOX management tool), served as the business owner of four applications.  Conducted technical accounting research on non-routine corporate transactions, prepared and reviewed technical accounting memos and communicated technical accounting conclusions to the management.  Partnered with SEC, FP&A, IT, HR and other organizations to drive constant improvement in accounting operations efficiency, effectiveness and scalability to support accurate and timely financial reporting. Jumio Corporation (Palo Alto, CA) Controller, US Led global accounting operations, financial reporting, and compliance while getting ready for IPO. Responsible for global EOM close, consolidated financial statements, audits, business systems implementation and integration. Oversaw international accounting, intercompany transactions, treasury, accounts payable, revenue operations, Netsuite ERP administration, US and international payroll and equity. __________ September 2019-August 2020  Managed global EOM close and consolidated financial reporting.  Shortened EOM close from 10 to 6 business days by partnering with international Controllers and automating and streamlining processes: AP vendor approval, JE upload, elimination and revaluation functions in NetSuite, PO Module for more accurate accruals, Concur/NetSuite/Amex integration for auto-feed.  Reviewed financial reporting packages and monthly reconciliations of international entities ensuring compliance with accounting standards and company policies.  Responsible for statutory filings and compliance in international subsidiaries. Worked closely with local accountants to meet filing requirements (VAT, GST, Income Tax returns, statutory audits).  Developed and managed AP and AR functions in India to support global PTP and OTC cycles.  Transitioned outsourced international payroll in-house. Implemented ADP/Celergo in UK and Canada, eliminated manual     cash disbursements and improved employee experience. Implemented ASC 606 commissions accounting. Improved T&E management by implementing Concur worldwide. Integrated with NetSuite and the banks. Implemented multi-books in NetSuite to accommodate GAAP vs statutory accounting postings requirements. Implemented internal controls around multiple processes within NetSuite: journal entry approval, vendor bills approval for accounting and payment, reviewed user roles and permissions to eliminate conflicts in SOD.  Partnered with cross-functional teams to support functional owners with reporting and process automation (automated PO  approval process) and to solve for accounting needs (internally developed software and lease accounting). Implemented Purchase Order policy and Purchase Order Module in NetSuite globally. Designed and rolled out the workflow, approval matrix, created the policy and training materials. Quotient Technology Inc, Mountain View, CA (NYSE: QUOT) Assistant Corporate Controller Managed global accounting operations and led global accounting teams. Oversaw global monthly, quarterly and annual close process, preparation and review of consolidated financial statements, quarterly reviews and annual audits, as well as SOX 404B compliance and testing. July 2017-September 2019  Oversaw global GL, consolidation, leases, foreign currency accounting, payroll and equity, AP and Fixed Assets.  Managed annual audits (consolidated and statutory) and quarterly reviews with external audit firms.  Created and managed a remote team in India to support US and international accounting operations.  Transitioned UK and France accounting operations from 3rd party providers to a shared services center in India.  Designed and implemented processes and automated systems around emerging business streams company-wide  Participated in complex contract structuring to assess accounting impact, systems needs and financial transaction flow.  Managed M&A activities - full cycle from valuation, due diligence, and purchase price accounting all the way to systems  integration, consolidated Financial Statements, controls, KPI’s tracking and reporting. Implemented NetSuite (all accounting cycles, including international subsidiaries). Staged and executed in close partnership with other functional teams. Achieved impeccable results. Implemented FloQast worldwide, provided real time visibility into EOM close process, shortened EOM close by 3 days.   Supported SEC reporting for 10Q and 10k, reviewed and prepared supporting schedules and tie-outs. Prepared and reviewed technical accounting memos for the areas of responsibility and presented to EY.  Implemented ASC 842, responsible for completeness and accuracy of worldwide lease accounting and SOX controls.  Responsible for 25 SOX 404B controls in the following areas: PTP, PPE, TRE, COG, FSC. Executed first year SOX 404B with no significant deficiencies. Managed five systems within SOX 404B scope.  Collaborated closely with Internal Audit, SEC Reporting, FP&A, Tax and Treasury, Legal, HR, IT, and Procurement functions: PO module approval workflow, capitalized SW projects, etc. Provided guidance, working as one team.  Chaired the quarterly Disclosure Committee meeting with members that included CFO and CAO.  Developed and mentored international and US teams. Promoted Finance Manager to International Controller, Accountant to Senior Accountant and Accounting Manager to Sr. Accounting Manager. Natera Inc, San Carlos, CA (NASDAQ: NTRA) Assistant Corporate Controller Responsible for accounting operations: accounts payable, fixed assets, general ledger, EOM close, quarterly reviews, external audits, internal controls risk assessment, cash management and projections, Accounts Receivable. June 2016-July 2017  Served as the main contact during quarterly EY reviews, interim audits, SEC filings, SOX compliance walkthroughs.  Served as an acting Corporate Controller during Controller’s maternity leave.  Responsible for 10Q and 10K filings: financial statements, disclosure checklists, accounting memos, PBCs.  Researched technical accounting literature to resolve accounting questions and drafted memos.  Created and managed Company’s tax filing and compliance calendars: income, use, property and franchise tax filings.  Improved company’s accrual process by partnering with functional leaders and implementing purchase requisition approval process companywide. Engaged FP&A function into accrual process for more accurate results.  Managed fixed assets accounting: monthly depreciation, quarterly asset valuation, ongoing CIP and assets held-for-sale monitoring, impairment analysis and documentation.  Represented finance organization at new product development, participated in pricing and market strategy and its revenue recognition implications.  Established and tracked Accounting Operations KPI’s and reported monthly to the executive team. Zscaler Inc., San Jose, CA (NASDAQ: ZS) Assistant Corporate Controller Managed worldwide accounting operations in four subsidiaries during the time of rapid growth: consolidated financial statements, audits, international and US tax compliance, global consolidation, internal and external reporting, budgeting, revenue recognition, internal controls, AP, AR, GL, Payroll (ten countries worldwide). April 2012 – June 2016 Implemented and administered following systems: NetSuite, Certent Avalara, ADP, Concur. Implemented multiple finance initiatives company-wide: PO Module, T&E process, tax calendar.  Actively participated in IPO readiness.  Prepared and presented monthly financial package to CFO. Analyzed and explained actual / budget / forecast variances.    Responsible for oversight of international accounting, payroll and equity.  Oversaw team in India to support OTC, PTP and international payroll cycles.   Managed periodic 409A valuations. Supported the process by preparing cap table, financial statements and forecast.  Administered company’s equity compensation plan. Responsible for stock-based compensation accounting. Initiated and conducted Nexus / Sales Tax study, VAT study. Managed sales tax and VAT filings. CPA coursework and licensing and cared after a sick child August 2011 –April 2012 Deem Inc., Foster City, CA Assistant Controller (Dec 2009 – Aug 2011), Accounting Manager (Feb 2007 – Nov 2009) Managed international accounting operations in four subsidiaries. Responsible for company-wide financial close, accuracy and integrity of general ledger, intercompany accounting, cash management, AP, AR, payroll and tax compliance, financial reporting. February 2007-August 2011 Implemented companywide revenue recognition policy according to ASC 605.  Scaled accounting function during the time of a rapid growth. Started as individual contributor and built the team.  Pioneered and completed the Company’s first five year audit and managed subsequent audits conducted by E&Y.  Led implementation of accounting system from Quickbooks to NetSuite.   Managed revenue recognition in four subsidiaries with multiple revenue streams and complex contracts.  Streamlined payroll processing by implementing ADP PayExpert and transitioning from Intuit Payroll.   Responsible for due diligence and accounting and payroll integration of three acquired subsidiaries.  Promoted two AP Associates to Staff Accountants and two Staff Accountants to Financial Analysts. Improved vacation time accrual reporting by implementing ADP Time and Attendance module companywide. Embarcadero Publishing Company, Palo Alto, CA Accounting Manager Managed company''s accounting operations in six divisions. Supported executive management in all accounting matters including treasury function, budgeting and operational oversight. October 2001 – February 2007 Implemented MAS 90 and transitioned company’s accounting records from RealWorld.  Prepared consolidated financial statements and flux analysis. Served as a primary point of contact with external auditors.   Participated in a liquidation and opening of a new division. Responsible for due diligence and acquisition accounting.  Supervised eight direct reports. Conducted performance reviews and appraisals, reviewed employee compensations. CPA (CA active license) B.A. in English and German Languages with Honor, Eastern European National University, Ukraine EDUCATION', '{"basics": {"email": "Iryna.Buynytska@gmail.com", "phone": "718-6964", "social": [], "lastName": "Buynytska", "linkedIn": null, "location": {"city": "Sunnyvale", "state": "CA", "country": "USA"}, "firstName": "Iryna", "currentCompany": "Wonolo, Inc", "currentJobTitle": "Corporate Controller", "totalExperienceInMonths": 240}, "skills": ["US GAAP", "IFRS", "Oracle", 