nd daily accounting operations."}, {"end": {"year": 2020, "month": 8}, "org": "Jumio Corporation", "level": "Mid-level", "start": {"year": 2019, "month": 9}, "title": "Controller, US", "location": "Palo Alto, CA", "description": "Led global accounting operations, financial reporting, and compliance while getting ready for IPO. Responsible for global EOM close, consolidated financial statements, audits, business systems implementation and integration. Oversaw international accounting, intercompany transactions, treasury, accounts payable, revenue operations, Netsuite ERP administration, US and international payroll and equity."}, {"end": {"year": 2019, "month": 9}, "org": "Quotient Technology Inc", "level": "Mid-level", "start": {"year": 2017, "month": 7}, "title": "Assistant Corporate Controller", "location": "Mountain View, CA", "description": "Managed global accounting operations and led global accounting teams. Oversaw global monthly, quarterly and annual close process, preparation and review of consolidated financial statements, quarterly reviews and annual audits, as well as SOX 404B compliance and testing. Oversaw global GL, consolidation, leases, foreign currency accounting, payroll and equity, AP and Fixed Assets. Managed annual audits (consolidated and statutory) and quarterly reviews with external audit firms. Created and managed a remote team in India to support US and international accounting operations. Transitioned UK and France accounting operations from 3rd party providers to a shared services center in India. Designed and implemented processes and automated systems around emerging business streams company-wide. Participated in complex contract structuring to assess accounting impact, systems needs and financial transaction flow. Managed M&A activities - full cycle from valuation, due diligence, and purchase price accounting all the way to systems integration, consolidated Financial Statements, controls, KPI’s tracking and reporting. Achieved impeccable results. Supported SEC reporting for 10Q and 10k, reviewed and prepared supporting schedules and tie-outs. Prepared and reviewed technical accounting memos for the areas of responsibility and presented to EY. Implemented ASC 842, responsible for completeness and accuracy of worldwide lease accounting and SOX controls. Responsible for 25 SOX 404B controls in the following areas: PTP, PPE, TRE, COG, FSC. Executed first year SOX 404B with no significant deficiencies. Managed five systems within SOX 404B scope. Collaborated closely with Internal Audit, SEC Reporting, FP&A, Tax and Treasury, Legal, HR, IT, and Procurement functions: PO module approval workflow, capitalized SW projects, etc. Provided guidance, working as one team. Chaired the quarterly Disclosure Committee meeting with members that included CFO and CAO. Developed and mentored international and US teams. Promoted Finance Manager to International Controller, Accountant to Senior Accountant and Accounting Manager to Sr. Accounting Manager."}, {"end": {"year": 2017, "month": 7}, "org": "Natera Inc", "level": "Mid-level", "start": {"year": 2016, "month": 6}, "title": "Assistant Corporate Controller", "location": "San Carlos, CA", "description": "Responsible for accounting operations: accounts payable, fixed assets, general ledger, EOM close, quarterly reviews, external audits, internal controls risk assessment, cash management and projections, Accounts Receivable. Served as the main contact during quarterly EY reviews, interim audits, SEC filings, SOX compliance walkthroughs. Served as an acting Corporate Controller during Controller’s maternity leave. Responsible for 10Q and 10K filings: financial statements, disclosure checklists, accounting memos, PBCs. Researched technical accounting literature to resolve accounting questions and drafted memos. Created and managed Company’s tax filing and compliance calendars: income, use, property and franchise tax filings. Improved company’s accrual process by partnering with functional leaders and implementing purchase requisition approval process companywide. Engaged FP&A function into accrual process for more accurate results. Managed fixed assets accounting: monthly depreciation, quarterly asset valuation, ongoing CIP and assets held-for-sale monitoring, impairment analysis and documentation. Represented finance organization at new product development, participated in pricing and market strategy and its revenue recognition implications. Established and tracked Accounting Operations KPI’s and reported monthly to the executive team."}, {"end": {"year": 2016, "month": 6}, "org": "Zscaler Inc.", "level": "Mid-level", "start": {"year": 2012, "month": 4}, "title": "Assistant Corporate Controller", "location": "San Jose, CA", "description": "Managed worldwide accounting operations in four subsidiaries during the time of rapid growth: consolidated financial statements, audits, international and US tax compliance, global consolidation, internal and external reporting, budgeting, revenue recognition, internal controls, AP, AR, GL, Payroll (ten countries worldwide). Actively participated in IPO readiness. Prepared and presented monthly financial package to CFO. Analyzed and explained actual / budget / forecast variances. Responsible for oversight of international accounting, payroll and equity. Oversaw team in India to support OTC, PTP and international payroll cycles. Managed periodic 409A valuations. Supported the process by preparing cap table, financial statements and forecast. Administered company’s equity compensation plan. Responsible for stock-based compensation accounting. Initiated and conducted Nexus / Sales Tax study, VAT study. Managed sales tax and VAT filings."}, {"end": {"year": 2011, "month": 8}, "org": "Deem Inc.", "level": "Mid-level", "start": {"year": 2007, "month": 2}, "title": "Assistant Controller", "location": "Foster City, CA", "description": "Managed international accounting operations in four subsidiaries. 