eparate entities. Implemented ASC 606 revenue recognition process. Implemented AuditBoard, SOX implementation system. Improved monthly reporting and developed a unified package for all three business lines. Reduced monthly close cycle by 50% (from 20 days to 10). 2019 - 2021 ARRIVAL USA, INC (electric commercial vehicle manufacturer) Public growth-stage entity (ARVL), over $15B market capitalization at the time Chief Financial Officer (CFO) and Board member (reported to CEO and investors) Served as CFO and director of all US subsidiaries of Arrival SA and Kinetik Sarl, the ultimate parent entity. Positioned entities for growth by securing leases, financing, payroll, benefits and staff for all US entities. Established accounting systems and reporting structures under IFRS. Positioned US entities for successful SPAC IPO. 2019 - 2020 VISTAJET, LTD (on-demand private jet operator) PE backed growth-stage entity, $1.6B revenue Consultant (reported to CFO and Controller) Performed carve-out of XOJet under IFRS into four separate entities following its purchase by VistaJet. Carve-out included the operations of air operator certificate holder which were divested into a majority-owned US entity. Developed legal and accounting processes for cross-charges and re-charges between entities and the AOC holder. Concluded project following completion of AOC holder’s first audit under US GAAP the following year. 2015 - 2018 SOLOPOWER SYSTEMS, INC (lightweight, flexible solar product developer and manufacturer) VC backed growth-stage entity, total funding approaches $300M Chief Financial Officer (CFO) and Vice President (reported to CEO and Chairman) Secured several rounds of debt funding (over $50M) and continually lengthened the company’s cash runway. Concluded agreement with contract manufacturer to expand capacity with no equipment or working capital investment. Completed London Stock Exchange (LSE) IPO listing prospectus including audited financials under IFRS, working capital report, policy manuals, etc. Restated all financial statements for prior reorganization and converted from US GAAP to IFRS. Chartered Accountant and MBA Chartered Accountant and MBABryan Wang EXPERIENCE (continued) 2013 - 2015 FINANCIAL AND BUSINESS DEVELOPMENT CONSULTANT FINANCIAL AND BUSINESS DEVELOPMENT CONSULTANT Senior level finance consultant to high-tech, VC-backed companies Varied experience executing financial and business development projects for clients. Items of note include: Site selection and grant proposals culminating in over $5m of awarded grants and significant incentive awards (amount subject to NDA) for Norsk Titanium’s and Silevo’s (now part of Tesla) manufacturing facilities in the state of New York. Development of a European solar yieldco. S-1 IPO filing preparation and accounting restatements for ForeScout. 2011 - 2013 SVTC SOLAR, INC (solar developer and manufacturer, pre-revenue) Start-up entity (spin-out from SVTC Technologies) funded by $100M from DOE and third parties Vice President, Finance and Board Member (top finance position, 10+ reports via shared services) Lobbied, fundraised and negotiated over $100M of grants and contributions to launch entity (recognized with an Innovation Award from SVTC Technologies, the parent). Responsible for all reporting, including government accounting and reporting to the US Department of Energy. Successfully divested SVTC Solar business following insolvency of parent. 2009 - 2013 SVTC TECHNOLOGIES, LLC (contract semiconductor developer/manufacturer, $80M revenue) PE and VC backed growth-stage entity, 200+ employees, 10+ reports in shared service model Director, Treasury and Corporate Development (reported to CFO) Led treasury and corporate development operations. Corporate development activities included partnership agreements, investment transactions, real estate matters, key supplier contracts and licensing arrangements. Treasury duties included cash forecasting and management, loan negotiations, covenant reporting and compliance. Developed and presented marketing collateral to support investment and licensing activities and also created unique legal structures to support legal and tax requirements of the participating parties. Produced and presented materials for the board and senior executives. 2005 – 2009 TSMC - VENTURETECH ALLIANCE (VC firm, $200M managed) Manager of three TSMC venture capital funds Partner and CFO (individual contributor role)  Performed role of investment partner and CFO leading financial, infrastructure and legal operations. Developed investment strategy; sourced, evaluated and executed potential investments.  Drafted and negotiated term sheets for new and follow-on investments and performed due diligence. Managed investments post-transaction, acted as board observer. Established, managed and reported on complex fund structures involving offshore and blocker entities.  Managed internal financial operations including all tax reporting and filings (including K-1s) and IT and HR benefits.  Produced fund return and financial information and presented portfolio company updates to LP investors. 2004 – 2005 QUICKSILVER TECHNOLOGY, INC (fabless semiconductor manufacturer and IP licensor) VC backed growth-stage entity, 80 employees, 4 direct reports, $10M revenue Director, Finance (reported to CEO, top finance position)  Proposed, developed and implemented the company’s exit strategy and reorganized the company as an IP development and licensing firm. Negotiated termination contracts with customers and suppliers that enabled the company to minimize contractual exposure and accelerate revenue recognition.  Led financial and infrastructure operations. Responsible for all aspects of the company’s finance, accounting, tax, legal, facilities, IT and HR operations. Developed and presented materials to the board and investors.  Chartered Accountant and MBA Chartered Accountant and MBABryan Wang EXPERIENCE (continued) 2001 – 2003  BEARINGPOINT, INC (former