ation of annual budgets, forecasts, and cash flow projections. Managed company liquidity, ensuring optimal capital structure and maintaining relationships with financial institutions. Managed a cross-functional team of financial analysts, fostering a collaborative environment and continuous professional growth. Reporting CEO/VP of Finance of organization’s financial performance by providing monthly reporting of actuals vs. budget. Generated HR report using Power BI highlighting the employee turnover ratio, and headcount by the department that helped manage expenses within the budget. Provide support for finance efforts to increase efficiency and add value to business partners, including data mining and identifying, tracking, and reporting on KPIs. Monitored financial performance by measuring and analyzing results; initiated corrective actions; minimized the impact of variances by 30%. Directed and accelerated month-end closing process including journal entries, reconciliations, and variance analysis, significantly improving reporting timeliness and operational efficiency. Provided guidance on complex accounting matters such as revenue recognition, derivatives, leases. Oversaw accounts payable and receivable department to ensure accurate and timely payments and deposits. Oversaw the financial and accounting teams, ensuring timely financial reporting, budgeting, and forecasting. Prepared ad hoc analyses as requested by senior leadership, aiding in agile and informed decision-making. Implemented cutting-edge technologies to streamline financial operations, boosting data accuracy by 40% and fostering operational efficiency. Ensured compliance with GAAP principles in all transactions & reporting activities, enhancing accuracy by 20%. Maintained detailed records of all financial transactions, including accounts payable and receivable, budgeting, forecasting, payroll, and general ledger. Proven leadership in guiding and mentoring finance and accounting teams, with a focus on ensuring rigorous financial controls, process optimization, and driving excellence in execution. Monitored and evaluated performance of accounting and other financial staff. Managed intercompany account reconciliations, ensuring accurate financial reporting and tax implications. Developed and implemented financial policies and procedures to ensure effective internal control systems. Advised management on potential risks associated with certain business decisions or investments. Developed and maintained relationships with external auditors and advisors. Maintained current knowledge of organizational policies and procedures, federal and state policies, and directives, and current accounting standards. Developed policies and procedures for effective cash management practices. Conduct the process of inventory count every month and facilitate inventory audit annually. Automating manual efforts, including reports and dashboard, by using excel and Business Intelligence tools and driving process improvements across multiple functions and teams, resulting in substantial improvement in the company''s productivity. Directed and accelerated month-end closing process including journal entries, reconciliations, and variance analysis slashing the cycle down from 10 days to 6 days, significantly improving reporting timeliness and operational efficiency."}, {"end": {"year": 2021, "month": 12}, "org": "BITS Pilani", "level": "Mid-level", "start": {"year": 2017, "month": 1}, "title": "Senior Researcher – Finance and Accounting", "location": "Pilani, India", "description": "Improving the internal audit system of the university for better transparency and timely reporting of errors. Led detailed financial analyses, including variance, profitability, and ROI analyses, to support business decisions. Created advanced financial models to predict future revenues and expenses. Led the annual budgeting and forecasting processes, providing detailed financial analyses and recommendations. Con