 practice, Insurance and Risk Management, Corporate Governance and Ethics, and Entrepreneurship. Providing academic support to the head of the Department of Geological Sciences Representing the department at international conferences and academic events. Conducting lectures and tutorials for undergraduate and graduate students"}, {"end": {"year": 2016, "month": 4}, "org": "Singhal Raghav & Co.", "level": "Associate-level", "start": {"year": 2015, "month": 12}, "title": "Controller", "location": null, "description": "Conducted monthly variance analyses, generating actionable recommendations that drove productivity enhancements and elevated the company''s operational efficiency by 20%. Led internal audits for tax codes and regulatory compliance, ensuring all processes met regulatory standards. Created and maintained documentation related to Sarbanes-Oxley Act compliance requirements. Researched accounting issues for compliance and maintained a system of controls over accounting transactions. Handled cash management and forecasting functions to facilitate financial operations. Monitored cash flow and reserve levels to meet legal and regulatory requirements. Analyzed data to identify trends and highlight areas of concern. Crafted and monitored budget alignments and variances, facilitating improved efficiency in the reporting processes, and crafted dynamic financial models for extensive valuation analysis. Spearheaded audit teams through statutory and concurrent audits of multinational entities and financial institutions, ensuring precise and insightful audit reporting to clients and senior management. Enhanced internal control systems, boosting operational effectiveness and efficiency within client businesses. Overseeing accounting team and working closely on preparation of financial statements."}, {"end": {"year": 2015, "month": 6}, "org": "K N Gungutia & Co.", "level": "Fresher-level", "start": {"year": 2014, "month": 12}, "title": "Finance and Audit Assistant", "loca