lemented improvements to the quality of valuation methodologies, analyses, and reporting for the client portfolio companies’ monthly valuations. MARK D. SCHINDEL Mark@MDSchindel.com Chicago, IL 60626 312.961.5665 PRIVATE INVESTOR; Chicago, IL Investment Management • Managed my personal stock portfolio consisting primarily of shares of undervalued companies with a high dividend yield and a low 2003 - 2009 ratio of stock price to book value. 1998 - 2003 AMERICAN CAPITAL, LTD.; Chicago, IL Publicly traded middle market buyout fund approximately $84 billion of assets under management. Principal • Responsible for sourcing, analyzing, pricing, structuring, negotiating, acquiring, managing and exiting investments. Managed all qualitative and quantitative aspects of due diligence including assessment of a target’s risks, opportunities, and potential exit strategies. Selected and coordinated the work of accountants, lawyers and consultants. Analyzed a target’s products, competitive position, operations, assets, liabilities, revenue streams, cost structure, and cash flow. Conducted post-close integration planning, regulatory and compliance checks; systems reviews, and management assessments. Participated in the closing of seven transactions employing over $160 million of senior debt, subordinated debt, preferred stock and common stock. Negotiations involved co-investors, management teams, sellers and lenders. Portfolio management responsibilities included: planning and executing the corporate strategy at the board level; assisting management in identifying, analyzing and closing acquisitions; assessing new products and markets; raising debt capital, designing covenants, recruiting senior executives, and performing quarterly valuations. Served on six boards of directors. Opened the Chicago office and recruited professional and administrative staff. Responsible for developing a budget and managing to an office P&L. • • • • PENNINGTON PARTNERS & CO.; Chicago, IL Private equity i