	('6fe408f9-c31b-4afa-a2e7-742771606d8b', '2024-10-23 11:21:13.420632+00', 'd6dc262a-4ba3-4282-a6ce-90047b03dca3', 'https://ecfwsyxpcuzxlxrkhxjz.supabase.co/storage/v1/object/public/resume-job-post/public/a7701d36-b2bd-4795-815f-ab38f8f9d783.pdf', 'VERNA SUNDAR, CPA Certified Public Accountant vernapoon@gmail.com A transformational leader with a proactive, can-do attitude, consistently seeking opportunities to enhance processes and drive efficiencies. I thrive on motivating and empowering teams to embrace change, and I continuously look for innovative solutions that not only improve current operations but also position the organization for sustainable growth and success. I have excellent analytical and problem-solving skills with a strong focus on attention to detail and accuracy. WORK EXPERIENCE Storm8, LLC San Mateo, CA Senior Controller (2021 - present) ● Implemented a new ERP system (Sage Intacct) and payment automation software (Tipalti), resulting in annual savings of $200K and improved cash flow. ● Successfully coached the team to work efficiently and collaboratively, reducing the time required for the month-end close process from 10 days to 3 days, ensuring timely and accurate financial reporting. ● Oversee all areas of accounting, including GL accounting, revenue, technical accounting, payroll, and accounts payable, ensuring compliance with taxation, regulatory and statutory requirements. ● Collaborate with cross-functional teams for budgeting and forecasting. ● Experience with accounting and transfer pricing across international subsidiaries and customers. ● Assist with ICFR compliance activities for the corporate accounting team, including developing and executing internal controls. ● Manage and oversee the operation of the company 401(k) retirement plan across 4 different entities. Ensure the plan complies with regulatory requirements, operates efficiently, and provides value to participants. ● Coordinate and compile monthly reporting packages highlighti