ion of audit timing, delivery of audit schedules, and timely resolution of issues. ● Coordinated with external tax consultants on tax compliance and R&D Tax Credit efforts. ● Managed the revenue reporting function, including the creation, analysis, and presentation of comprehensive revenue reports to senior management. Senior Accountant (2012 – 2013) ● Partnered with HR Generalist to develop payroll and employee benefits operations, while implementing ADP Workforce Now and BambooHR. ● Ensured accurate and timely payroll calculations, including salary, overtime, bonuses, deductions, and tax withholdings. ● Responsible for monthly and annual close process, including preparation of journal entries, adjustments, accruals, expense allocations, and accounts reconciliation. ● Developed and maintained the monthly close schedule and supporting documentation. Pelican Advisors, LLC San Francisco, CA Controller (2011 - 2012) ● Managed the family''s philanthropic activities, including the administration of charitable foundations or trusts. ● Maintained accurate and up-to-date financial records for all family members and entities, including income, expenses, investments, and other financial transactions. ● Upheld a high level of discretion and confidentiality, given the sensitive nature of the work. SummerHill Homes San Ramon, CA Assistant Controller (2006 - 2011) ● Prepared consolidated monthly financials (balance sheet, P&L, cash flow) and overhead analysis. ● Prepared quarterly bank financials to ensure that lenders’ covenant requirements were met. ● Prepared monthly payroll allocations to corporate and projects to ensure proper reimbursement. ● Maintained the fixed asset schedule and ensured proper coding in fixed assets and in the general ledger. ● Assisted the CFO and Controller with the annual G&A budget forecast. ● Assisted with the annual audit through preparation of schedules and other support to external auditors. ● Assisted with writing and maintaining policies, processes, and procedures to improve efficiencies and controls. ● Analyzed and prepared monthly general ledger account reconciliations, ensuring accuracy and completeness of financial data. Project Accountant (2003 - 2006) ● Maintained and managed the monthly activity for 6 projects’ general ledgers to ensure items were entered and recorded properly according to GAAP. ● Conducted variance analysis on project costs and revenues, providing detailed explanations and reports to management. ● Managed cash flow for multiple projects, including monitoring cash balances, forecasting cash needs, and ensuring sufficient funds for project expenses. ● Prepared project loan draws and functioned as the liaison for any loan issues and requirements. ● Coordinated with the accounts payable team to process payments, verify invoices, and ensure compliance with company policies and procedures.  Seiler & Company Redwood City, CA Staff Accountant (2001 - 2003) ● Provided assurance and consulting services to private technology, non-profit, and privately owned real estate investment clients. ● Prepared partnership, corporate, trust, individual, and non-profit tax returns. ● Prepared and reviewed monthly, quarterly, and annual financial statements, including income statements, balance sheets, and cash flow statements. PricewaterhouseCoopers, LLP San Jose, CA Experienced Associate (1999 - 2001) ● Provided assurance and consulting services to public and private technology clients and a venture capital client. ● Supervised audit team for efficient completion of audit engagement and achievement of audit strategies. ● Completed a year-end carve-out related to an acquisition. ● Conducted variance analysis and provided detailed explanations of financial results to senior management. ● Conducted thorough audits of financial statements to ensure accuracy and compliance with accounting. standards. ● Reviewed and ensured the consistency and accuracy of management’s notes to financial statements, verifying 