. Developed commission calculation template to reflect company commission policy and calculate commission numbers. Bi-weekly payroll processing and transfer the payroll data to NetSuite via journal entries."}, {"end": {"year": 2016, "month": 2}, "org": "Metabyte, Inc.", "level": "Mid-level", "start": {"year": 2015, "month": 2}, "title": "Finance & Accounting Manager", "location": "Fremont, CA", "description": "Manage daily accounting operations including GL, Payroll, AR, AP, Month-end closing and financial reporting. Work with external CPAs for tax compliance and financial audit. Work with CEO for annual plan, forecast & budgeting. Process payroll bi-weekly and file 941 quarterly (Paycheck) File sales tax return quarterly."}, {"end": {"year": 2015, "month": 1}, "org": "Ronbow Corporation", "level": "Mid-level", "start": {"year": 2013, "month": 9}, "title": "Controller", "location": "Fremont, CA", "description": "Managing all aspects of accounting operations and month-end closing, including AR, AP, Payroll, Inventory, General ledger, etc. Manage intercompany transactions such as billing, journal entries, reconciliation and consolidation. Prepare consolidated financial reporting package. Equipment financing, bank relationship & cash flow management. Lead & oversee third party auditing, income tax filing. Manage income tax, sales tax, property tax, environmental, payroll tax compliance. Full cycle project management - converted ERP system from SAP to NetSuite."}], "certificates": ["Certified Public Accountant", "Certified Management Accountant"]}', NULL, NULL, NULL, NULL, 'resume'),
	('01e58178-5867-4f2a-8989-6e36e56527c5', '2024-10-23 11:21:13.447091+00', '352e038f-9112-4dd1-98be-90ffd97a67d7', 'https://ecfwsyxpcuzxlxrkhxjz.supabase.co/storage/v1/object/public/resume-job-post/public/726ba07f-9faa-4751-a773-092d9f48e825.docx', 'Jennifer Apple, MBA   229-9923(H) https://www.linkedin.com/in/jennifer-apple-8a15b4212/ JApple1688@gmail.com White front OBJECTIVE Financial Controller White front SUMMARY OF QUALIFICATION 25 + years experience in corporate accounting/finance in the semiconductor, networking, software, healthcare, hospital, and food industries  Budgeting, forecasting, treasury management, consolidation financial reporting, FLUX/ Ad hoc analysis, inter-company elimination process, international accounting, SOX Audit, and SEC filing Hands-on experience with consolidations and foreign currency issues (FAS 52) Strong knowledge of GAAP, ability to comprehend and perform complex technical accounting  Excellent communication, organization, and leadership skills. Strong analytical and problem-solving skills  International Financial Reporting Standards (IFRS)  Proficient in English and Taiwanese. SOFTWARE SKILLS NetSuite, Salesforce, ADP, Expensify, Oracle R12, OBIEE, DRM, HFM, Blackline, Concur, Hyperion Essbase, SAP, Great Plains & FRx, SQL/Crystal, QBO, Bill.com, Salesforce, Celigo, Avalara, Expensify, Microsoft Dynamics NAV, Microsoft Office Suite (Excel, Word, Access, Outlook and PowerPoint, etc.) PROFESSIONAL EXPERIENCE Ionpath, Inc., Campbell, CA September 2023 - Current Controller Software: NetSuite, ADP, BILL, Salesforce, Celigo, Avalara, Expensify In partnership with the CEO, oversee all financial operations, including accounting, financial reporting, budgeting, and forecasting, to ensure accuracy, compliance, and efficiency. Provide strategic financial input and leadership on decision-making to the leadership team and the Board. Implement forecasting/budgeting models and contribute strategic financial planning for C-suite and board members including assessing the company''s capital structure, and the mix of debt and equity, to attain the company''s long-term goals and objectives and maximize shareholder value. Manage all accounting operations including GL, Billing, A/R, A/P, Payroll, Fixed Assets, and Cost Accounting and analyze revenue, cost of sales, and other technical areas for proper accounting and alignment to Revenue Recognition (ASC 606). Develop and maintain effective cash management systems to ensure adequate cash balances and proper investment strategies. Ensure tax compliance and necessary registrations with various state and local agencies. Maintain strong working relationships with the bank and insurance providers, coordinating all business transactions and advising the Executive Director on related issues. Monitor and track compliance with covenants and loan agreements.  List Biological Laboratories, Inc., Campbell, CA February 2023 - August 2023 Controller Software: NetSuite, ADP, Coupa, BILL, Avalara, Expensify Implemented NetSuite key functions for finance, accounting, procurement, manufacturing, inventory management, and order management with 100% automation, resulting in a reduction of 50% manpower for the team and 100% accuracy in financial reporting. Managed all accounting operations including GL, Treasury management, A/R, A/P, GL, Cost Accounting, Inventory Accounting, Revenue recognition (ASC 606), and external audits. Implemented effective internal policies and procedures and automation, resulting in significantly improved accounting processing qualities to reduce 50% manpower and month-end closing times from 15 days to 5 days. Safeguard assets and ensure accurate and timely recording of all transactions by implementing disciplines of internal audits, controls, and checks across all departments. Assist the CFO and other department heads in preparing the annual budget, monitor the budget throughout the year for variances; and communicate discrepancies promptly to the management team. Create a variety of monthly financial reports and present them to various audiences, including the Board, Finance & Policy Committee, and other relevant stakeholders’ team Sun Basket, Inc., San Jose, CA December 2016 - February 2023 Assistant Corporate Controller Software: QBO, Bill.com, ADP, Microsoft Dynamics NAV, Avalara, Expensify Started as accounting manager, got promoted to accounting director within 3 months, then promoted to assistant corporate controller within a year. Analyzed the company’s financial results concerning P&Ls and issued reports to department heads monthly. interpret their departmental P&L reports to create action plans needed to improve operations. Partner with FP&A on the actual vs. budget to VP Controller, CFO, and board members throughout the year. Treasury management - managed cash flow to ensure the cash forecast process was aligned with actual. Direct all aspects of accounting operations related to general ledger, cost accounting, revenue, payables, receivables, and compliance. This resulted in 100% accurate deliveries and reduced the monthly closing cycle to 5 days from 21 days. Implemented ERP systems – QBO, Bill.com, and Microsoft Dynamics, ADP systems for the company, and served as a system administrator to maintain the system''s integrity. Establish, monitor, and enforce policies and procedures in all aspects of accounting, ensuring 100% US GAAP compliance. Served as primary contact to outside CPA firms/agencies, to oversee the regulatory reporting, frequently including tax planning and compliance in coordination with external CPA. Conducted due diligence to facilitate corporate investments and fund-raising activities. Google October 2012 - December 2016 Direct of Finance/Accounting Software: Oracle R12, 11i, HFM, DRM, Essbase, OBIEE, Blackline, SAP Accounting Management: Managed 400+ entities’ month-end close within the system and produced the consolidated financial reports with 100% accuracy and on time with US GAAP