	('3642ed7c-4d52-4717-9820-f019cfb06f7a', '2024-10-23 11:21:13.210082+00', '4385ea9f-fcdd-4aa7-8a14-22f55233268e', 'Interview reminder', '<p><strong>Scheduled with candidate :</strong><br><a target="_blank" rel="noopener noreferrer" class="c-link" href="https://dev.aglinthq.com/interviews/view?meeting_id=5ad7e0df-be62-4461-a069-33e884b70c4f&amp;tab=candidate_details"><strong>Ashis Sarthak Singh - Staff Frontend Engineer</strong></a></p><p><strong>Meeting Place :</strong> In Person Meeting<br><strong>Meeting Time :</strong> July 15 03:30 AM - 04:00 AM IST<br><strong>Duration :</strong> 30 Minute      </p>', '', 'interviewStart_slack_interviewers'),
