	('3c532361-7f05-4d44-9964-961af35f1e8e', '2024-10-23 11:21:13.210082+00', '4385ea9f-fcdd-4aa7-8a14-22f55233268e', 'Welcome to Aglint', '<p>Dear <span class="temp-variable" data-type="temp-variable" data-id="organizerName">{{organizerName}}</span> </p><p></p><p>Thank you for registering with Aglint! we are excited to have you on board, To ensure a smooth onboarding process, please have the following information ready:</p><p>For the company setup, keep the company name, location, and departments handy.</p><p>For user onboarding, have the names and emails addresses of hiring team members, as well as the roles of interviewers who will collaborate on hiring.</p><p>For job listings, get the job descriptions ready and indentify the hiring team for each job.</p><p>For user onboarding, have the names and email addresses of hiring team members, as well as the roles of interviewers who will collaborate on hiring.</p><p>For job listings, get the job descriptions ready and identify the hiring team for each job.</p><p>Additionally, organize interview plans for each job.</p><p>For interview types, define the types of interviews you will conduct, and prepare the necessary qualifications and training data.</p><p>Choose any integrations you need, such as ATS, Google Meet, Zoom, Slack, Google Workspace, or Microsoft Outlook.</p><p>One of our customer success team members will contact you soon. We appreciate your patience. Best regards, Aglint AI Customer Success Team</p><p></p><p>Best regards,</p><p>Aglint AI Customer </p><p>Success Team</p>', NULL, 'onSignup_email_admin'),
	('52fc77dd-42ed-47c6-8438-d5e9403b4d98', '2024-10-23 11:21:13.210082+00', '4385ea9f-fcdd-4aa7-8a14-22f55233268e', '<p>Availability Re Request</p>', '<p>Dear <span class="temp-variable" data-type="temp-variable" data-id="candidateFirstName">{{candidateFirstName}}</span> ,</p><p>I hope this message finds you well.</p><p>I am writing to follow up regarding the availability check for your upcoming interview. It appears that the initial link we sent to confirm your availability might not have been received or may have encountered an issue.</p><p>To ensure we can schedule your interview at a convenient time, please find the link below to select your preferred time slots:</p><p>We apologize for any inconvenience this may have caused and appreciate your understanding.</p><p>Thank you for your cooperation. We look forward to speaking with you soon.</p><p>Best regards,</p><p><span class="temp-variable" data-type="temp-variable" data-id="organizerName">{{organizerName}}</span> </p><p><span class="temp-variable" data-type="temp-variable" data-id="companyName">{{companyName}}</span> Recruitment Team.</p>', '{{companyName}}', 'availabilityReqResend_email_candidate'),
	('5e57a0b3-9825-4b7f-bc3e-97a79befe89e', '2024-10-23 11:21:13.210082+00', '4385ea9f-fcdd-4aa7-8a14-22f55233268e', '<p>Interview Reminder: <span class="temp-variable" data-type="temp-variable" data-id="jobRole">{{jobRole}}</span> Position at <span class="temp-variable" data-type="temp-variable" data-id="companyName">{{companyName}}</span> </p>', '<p>Dear <span class="temp-variable" data-type="temp-variable" data-id="candidateFirstName">{{candidateFirstName}}</span> ,</p><p>This is a friendly reminder about your upcoming interview for the <span class="temp-variable" data-type="temp-variable" data-id="jobRole">{{jobRole}}</span> position at <span class="temp-variable" data-type="temp-variable" data-id="companyName">{{companyName}}</span>.</p><p></p><p>Please ensure you are prepared and join the interview on time. We are excited to learn more about your experiences and insights.</p><p></p><p>Please find the details of your interview below.</p><p></p><p>Best regards,</p><p><span class="temp-variable" data-type="temp-variable" data-id="organizerName">{{organizerName}}</span></p><p><span class="temp-variable" data-type="temp-variable" data-id="companyName">{{companyName}}</span> Recruitment Team</p><pre><code class="language-yaml"></code></pre>', '{{organizerName}}', 'interviewStart_email_applicant'),
