INSERT INTO "public"."interview_module" ("created_at", "name", "recruiter_id", "id", "duration_available", "description", "settings", "instructions", "created_by", "is_archived", "department_id") VALUES
	('2024-10-23 11:21:13.79303+00', 'Data Science Case Study', '4385ea9f-fcdd-4aa7-8a14-22f55233268e', 'f852d49a-b6f6-4f34-aeec-8c7974439fc7', '{"activeDuration": 30, "availabletimeSlots": []}', 'Assess the candidate''s ability to analyze data, build models, and generate insights.', NULL, 'Candidates will be given a dataset to analyze and will be asked to present their findings and recommendations. You may use Python, R, or any other tool you are comfortable with. Be prepared to explain your methodology and the rationale behind your decisions.', '9d108c18-12a7-492c-bf37-21c316088d75', false, 311),
	('2024-10-23 11:21:13.79303+00', 'Behavioral Interview', '4385ea9f-fcdd-4aa7-8a14-22f55233268e', 'b3e51199-c7ff-4a75-b5d7-909918b6dcc3', '{"activeDuration": 30, "availabletimeSlots": []}', 'Understand the candidate''s soft skills, cultural fit, and ability to work within a team.', NULL, 'This interview will focus on your past experiences, how you handled various work situations, and how you interact with others. Prepare to discuss specific examples of how you dealt with challenges or collaborated with teammates.', '9d108c18-12a7-492c-bf37-21c316088d75', false, 311),
	('2024-10-23 11:21:13.79303+00', 'Final Interview with Hiring Manager', '4385ea9f-fcdd-4aa7-8a14-22f55233268e', 'a26444e1-bb3b-496f-8b1f-459123b84906', '{"activeDuration": 30, "availabletimeSlots": []}', 'Make a final assessment of the candidate''s suitability for the role, including both technical and cultural fit.', NULL, 'This will be a comprehensive interview covering both technical skills and cultural fit. Be ready to discuss your overall career goals, how you can contribute to the team, and why you believe you are the right fit for the position.', '9d108c18-12a7-492c-bf37-21c316088d75', false, 311),
	('2024-10-23 11:21:13.79303+00', 'Technical Screening', '4385ea9f-fcdd-4aa7-8a14-22f55233268e', '534e7968-4e17-42d4-97cc-44b13ee68ca8', '{"activeDuration": 30, "availabletimeSlots": []}', 'Assess the candidate''s technical skills and problem-solving abilities.', '{"noShadow": 0, "noReverseShadow": 0, "require_training": true, "reqruire_approval": false}', 'Candidates will be asked to solve coding challenges and answer technical questions related to the job role. Ensure you have a stable internet connection and are in a quiet environment. The interview will be conducted via an online coding platform.', '9d108c18-12a7-492c-bf37-21c316088d75', false, 311),
	('2024-10-23 11:21:13.79303+00', 'DevOps Practical Assessment', '4385ea9f-fcdd-4aa7-8a14-22f55233268e', 'efc5bb6b-4010-481d-aa56-231d36079926', '{"activeDuration": 30, "availabletimeSlots": []}', 'Test the candidate''s ability to manage infrastructure, CI/CD pipelines, and deployments.', '{"noShadow": 0, "noReverseShadow": 0, "require_training": true, "reqruire_approval": false}', 'You will be tasked with setting up a CI/CD pipeline, configuring cloud infrastructure, or managing containerized applications. Ensure you are familiar with tools like Docker, Kubernetes, and Jenkins.', '9d108c18-12a7-492c-bf37-21c316088d75', false, 311),
	('2024-10-23 11:21:13.79303+00', 'Frontend Technical Interview', '4385ea9f-fcdd-4aa7-8a14-22f55233268e', 'fd08ac47-fefc-483b-8bba-9fb55058a5a8', '{"activeDuration": 30, "availabletimeSlots": []}', 'Evaluate the candidate''s proficiency in frontend technologies like HTML, CSS, and JavaScript.', '{"noShadow": 2, "noReverseShadow": 2, "require_training": true, "reqruire_approval": false}', 'Prepare to discuss your past projects and demonstrate your knowledge of frontend frameworks like React. You may be asked to complete a live coding task or to review and improve a sample UI design.', '9d108c18-12a7-492c-bf37-21c316088d75', false, 311),
	('2024-10-23 11:21:13.79303+00', 'Backend Technical Interview', '4385ea9f-fcdd-4aa7-8a14-22f55233268e', '6439c529-0367-4702-ab51-10a64cb004a0', '{"activeDuration": 30, "availabletimeSlots": []}', 'Examine the candidate''s understanding of backend systems, databases, and API development.', '{"noShadow": 3, "noReverseShadow": 3, "require_training": false, "reqruire_approval": true}', 'The interview will focus on backend architecture, database management, and API development. You may need to write and optimize queries or design a system''s backend. Be ready to discuss past experiences with backend development.', '9d108c18-12a7-492c-bf37-21c316088d75', false, 311),
	('2024-10-23 11:21:13.79303+00', 'Career Aspirations Discussion', '4385ea9f-fcdd-4aa7-8a14-22f55233268e', '65e98161-7896-4a2d-a285-e0b26cc4b1f7', '{"activeDuration": 30, "availabletimeSlots": []}', 'Assess the candidate’s career aspirations, motivations, and fit for the company culture.', NULL, 'This interview will focus on your career goals, motivations, and how you align with the company’s culture. Prepare to discuss your long-term aspirations and how you see yourself contributing to the organization.', '9d108c18-12a7-492c-bf37-21c316088d75', false, 311);
